(6, 'Kinh Doanh Mỹ Phẩm Không Cần Nhiều Vốn', 'kinh-doanh-m-phm-khng-cn-nhiu-vn', 'Các bạn có thể trải nghiệm xu hướng kinh doanh online ngay bây giờ.', '<p>Kinh Doanh Mỹ Phẩm Chỉ Từ 3 triệu.</p>\r\n<p>Kh&ocirc;ng cần nhiều vốn bạn c&oacute; thể kinh doanh mỹ phẩm chỉ với h&oacute;a đơn 3 triệu, c&aacute;c bạn sẽ được Shop cung cấp h&agrave;ng với gi&aacute; sĩ đối với h&agrave;ng c&oacute; sẵn.</p>\r\n<p>Kh&ocirc;ng &eacute;p số lượng, c&aacute;c bạn c&oacute; thể lấy số lượng &iacute;t nhất l&agrave; 1 cho mổi loại sản phẩm.</p>', '2014_04_08_15_56_24-shopmyphamhan-1977144_480986442001739_1998152275_n.jpg', '1', 1396946817, 1396947384, '2', '1');
