(1, 7, 'CC Cream TFS', 'CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++', 'cc-cream-thefaceshop-aqua-uv-color-control-cream-spf50-pa', 'Xuất xứ: Thefaceshop - Korea.\r\nChức năng cân chỉnh màu da, cho lớp nền đều màu cân bằng những vùng sáng tối trên da và che phủ khuyết điểm.', '<p><a title="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++" href="/shop/cc-cream-tfs/cc-cream-thefaceshop-aqua-uv-color-control-cream-spf50-pa"><span style="font-size: medium;"><strong>CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++</strong></span></a></p>\r\n<p><span style="font-size: medium; font-family: arial, helvetica, sans-serif; color: #000000;">Trọng Lượng: 20g</span></p>\r\n<p><span style="font-size: medium;"><span style="font-family: arial, helvetica, sans-serif; color: #000000;">Sau th&agrave;nh c&ocirc;ng của </span></span><a title=" Face It Aura Color Control Cream" href="/shop/cc-cream-tfs/cc-cream-thefaceshop-aura-color-control-cream-spf30-pa"><span style="font-size: x-large;"><strong style="font-family: arial, helvetica, sans-serif; font-size: small;">Face It Aura Color Control Cream</strong></span></a><span style="font-size: medium;"><span style="font-family: arial, helvetica, sans-serif; color: #000000;"> ra mắt đầu năm nay, Thefaceshop vừa tung ra d&ograve;ng </span><a title="CC Cream Aqua" href="/shop/cc-cream-tfs/cc-cream-thefaceshop-aqua-uv-color-control-cream-spf50-pa"><strong style="font-family: arial, helvetica, sans-serif; font-size: small;">CC Cream Aqua</strong></a><span style="font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;mới tinh n&agrave;y với khả năng vượt bậc hơn:</span></span></p>\r\n<p><span style="font-size: medium; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chống nắng SPF 50+ hơn cả kem chống nắng hằng ng&agrave;y bảo vệ l&agrave;n da dưới nắng mặt trời.</span></p>\r\n<p><span style="font-size: medium; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chống thấm nước gi&uacute;p giữ lớp trang điểm cả ng&agrave;y d&agrave;i.</span></p>\r\n<p><span style="font-size: medium; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Cơ chế l&agrave;m m&aacute;t mới gi&uacute;p giảm nhiệt cho da (giảm nhiệt bề mặt đến 2 độ C so với nhiệt độ cơ thể) th&iacute;ch hợp cho make up ban ng&agrave;y, thoải m&aacute;i ra nắng m&agrave; kh&ocirc;ng lo da bị bỏng r&aacute;t v&agrave; bị tia UV tấn c&ocirc;ng nữa.</span></p>\r\n<p><span style="font-size: medium; font-family: arial, helvetica, sans-serif; color: #000000;">&nbsp;+Chức năng c&acirc;n chỉnh m&agrave;u da, cho lớp nền đều m&agrave;u v&agrave; n&acirc;ng t&ocirc;ng da s&aacute;ng hơn một c&aacute;ch tự nhi&ecirc;n. Chất kem khi đ&aacute;nh l&ecirc;n da sẽ tự động chuyển m&agrave;u ph&ugrave; hợp với da bạn, c&acirc;n bằng những v&ugrave;ng s&aacute;ng tối tr&ecirc;n da v&agrave; che phủ khuyết điểm.</span></p>\r\n<p><span style="font-size: medium; font-family: arial, helvetica, sans-serif; color: #000000;"><span style="font-family: arial, helvetica, sans-serif; color: #000000;">C&oacute; 2 tone m&agrave;u: 01 - m&agrave;u s&aacute;ng v&agrave; 02 - tự nhi&ecirc;n.</span></span></p>\r\n<p><span style="font-size: medium; font-family: arial, helvetica, sans-serif; color: #000000;"><span style="font-family: arial, helvetica, sans-serif; color: #000000;"><img title="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++ 1" src="/uploads/img_product_detail/CC-CreamThefaceshopAquaUVColorControlCreamSPF50%20%281%29.jpg" alt="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50 PA++ 1" width="604" height="475" /></span></span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>', '2014_02_25_20_38_03-shopmyphamhan-CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA++.jpg', 440000, 370000, 'CCTFS02', 1, '0', 0, 0, '1', '1', '1', 1385538227),
(2, 6, 'BB Cream - Kem Nền TFS', 'BB Cream Magic Cover SPF20 PA++ ', 'bb-cream-magic-cover-spf20-pa', 'Xuất xứ: Thefaceshop - Korea.\r\nKem trang điểm đa năng, che khuyết điểm hoàn hảo, bổ sung chất chống oxy hóa giúp làm sáng và ngăn ngừa các dấu hiệu lão hóa sớm cho da.', '<p><a title="BB Cream Magic Cover SPF20 PA++" href="/shop/bb-cream-kem-n-n-tfs/bb-cream-magic-cover-spf20-pa"><strong><span style="font-size: medium;">BB Cream Magic Cover SPF20 PA++</span></strong></a></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch : 45ml</span></p>\r\n<p><span style="font-size: medium;">Kem l&oacute;t trang điểm đa năng với c&ocirc;ng thức th&ocirc;ng minh, chứa c&aacute;c hạt dưỡng chất DNA được bao bọc bởi lớp m&agrave;ng bảo vệ sẽ tự động k&iacute;ch hoạt v&agrave; thẩm thấu chất chống oxy h&oacute;a (Vitamin C, E) v&agrave;o da khi da tiếp x&uacute;c với &aacute;nh nắng mặt trời.</span></p>\r\n<p><span style="font-size: medium;">Đồng thời, BB Cream Magic Cover nhờ th&agrave;nh phần Dolwoe v&agrave; L&ecirc; Rừng trong sản phẩm gi&uacute;p <a title="l&agrave;m trắng v&agrave; ngăn ngừa c&aacute;c dấu hiệu l&atilde;o h&oacute;a" href="/shop/bb-cream-kem-n-n-tfs/bb-cream-magic-cover-spf20-pa"><strong>l&agrave;m trắng v&agrave; ngăn ngừa c&aacute;c dấu hiệu l&atilde;o h&oacute;a</strong></a> sớm, duy tr&igrave; sự tươi s&aacute;ng v&agrave; rạng rỡ l&acirc;u d&agrave;i cho l&agrave;n da.</span></p>\r\n<p><span style="font-size: medium;">C&oacute; 2 tone m&agrave;u : 01 - m&agrave;u s&aacute;ng v&agrave; 02 - tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: medium;"><img title="BB Cream Magic Cover SPF20 PA++ 1" src="/uploads/img_product_detail/bb-cream-magic-cover-spf20-pa.jpg" alt="BB Cream Magic Cover SPF20 PA++ 1" width="400" height="363" />&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>', '2014_03_25_22_12_40-shopmyphamhan-bb-cream-magic-cover-spf20-pa.jpg', NULL, 300000, 'BBTFS04', 1, '0', 0, 3, '1', '1', '1', 1385538402),
(4, 20, 'BB Cream ', 'Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ', 'red-bean-bb-cream-spf-20-pa-bb-cream-skinfood-chit-xut-u-', 'Xuất Xứ : Skinfood - Korea.\r\nĐây là dòng sản phẩm BB Cream dành cho da thường, da hỗn hợp.', '<p><span style="font-family: arial, helvetica, sans-serif; font-size: medium;" data-mce-mark="1"><strong><span style="font-family: arial, helvetica, sans-serif; font-size: medium;" data-mce-mark="1"><a title="Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ" href="/shop/bb-cream/red-bean-bb-cream-spf-20-pa-bb-cream-skinfood-chit-xut-u-">Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chiết Xuất Đậu Đỏ</a></span></strong></span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: medium;" data-mce-mark="1">Trọng lượng : 50g.</span></p>\r\n<p><span style="font-family: arial, helvetica, sans-serif; font-size: medium;" data-mce-mark="1">Đ&acirc;y l&agrave; d&ograve;ng sản phẩm </span><a title="BB Cream d&agrave;nh cho da thường, da hỗn hợp," href="/shop/bb-cream/red-bean-bb-cream-spf-20-pa-bb-cream-skinfood-chit-xut-u-"><strong style="font-family: arial, helvetica, sans-serif; font-size: medium;">BB Cream d&agrave;nh cho da thường, da hỗn hợp</strong></a><span style="font-family: arial, helvetica, sans-serif; font-size: medium;" data-mce-mark="1"><a title="BB Cream d&agrave;nh cho da thường, da hỗn hợp," href="/shop/bb-cream/red-bean-bb-cream-spf-20-pa-bb-cream-skinfood-chit-xut-u-">,</a> với độ che phủ cao c&ugrave;ng m&ugrave;i thơm nhẹ nh&agrave;ng, dưỡng chất tốt, </span><a title="BB Cream đậu đỏ" href="/shop/bb-cream/red-bean-bb-cream-spf-20-pa-bb-cream-skinfood-chit-xut-u-"><strong style="font-family: arial, helvetica, sans-serif; font-size: medium;">BB Cream đậu đỏ</strong></a><span style="font-family: arial, helvetica, sans-serif; font-size: medium;" data-mce-mark="1"> l&agrave; sản phẩm kh&ocirc;ng thể thiếu trong bộ sưu tập Skinfood.</span></p>\r\n<p style="text-align: cen