(15, 6, 'BB Cream - Kem Nền TFS', 'BB Cream Face It Power Perfection SPF37 PA++ ', 'bb-cream-face-it-power-perfection-spf37-pa', 'Xuất xứ: Thefaceshop - Korea.\r\nTính năng: làm trắng da, chống lão hóa và chống nhăn nhằm bảo vệ với độ che phủ SPF37.', '<p><a title=" BB Cream Face It Power Perfection SPF37 PA++ " href="/shop/bb-cream-kem-n-n-tfs/bb-cream-face-it-power-perfection-spf37-pa"><strong><span style="font-size: medium;">&nbsp;BB Cream Face It Power Perfection SPF37 PA++&nbsp;</span></strong></a></p>\r\n<p><span style="font-size: medium; color: #000000;">Dung t&iacute;ch : 40ml.</span></p>\r\n<p><span style="font-size: medium; color: #000000;">Đ&acirc;y l&agrave; sản phẩm BB cream chiết xuất từ Omega 3 v&agrave; phức hợp vita skin gi&uacute;p th&uacute;c đẩy sự sinh sản collagen v&agrave; phục hồi da, đem lại cho bạn một l&agrave;n da tr&agrave;n đầy sức sống v&agrave; s&aacute;ng khỏe. </span></p>\r\n<p><span style="font-size: medium; color: #000000;">Sản phẩm c&oacute; 2 tone: Tone s&aacute;ng v&agrave; tone tự nhi&ecirc;n </span></p>\r\n<p><span style="font-size: medium; color: #000000;">BB Cream Face It Power Perfection SPF37 PA++<strong>&nbsp;</strong>&nbsp;d&ugrave;ng được cho tất cả loại da, chủ động giải quyết những vấn đề về da như da kh&ocirc;, mất độ săn chắc, da xỉn m&agrave;u, kết cấu da kh&ocirc;ng đồng đều. </span></p>\r\n<p><span style="font-size: medium; color: #000000;"><a title="BB cream Power Perfection l&agrave;m trắng da, chống l&atilde;o h&oacute;a v&agrave; chống nhăn," href="/shop/bb-cream-kem-n-n-tfs/bb-cream-face-it-power-perfection-spf37-pa"><strong>BB cream <span>Power Perfection&nbsp;</span>l&agrave;m trắng da, chống l&atilde;o h&oacute;a v&agrave; chống nhăn,</strong></a> bảo vệ da khỏi &aacute;nh nắng mặt trời với độ che phủ ho&agrave;n hảo. Mang lại cảm gi&aacute;c thoải m&aacute;i, dễ chịu cho da Kết quả trang điểm tinh tế, l&acirc;u d&agrave;i .</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><img title="BB Cream Face It Power Perfection SPF37 PA++ 2" src="/uploads/img_product_detail/BBCreamFace%20ItPowerPerfectionSPF37PA%2B%2B1.jpg" alt="BB Cream Face It Power Perfection SPF37 PA++ 2" width="800" height="387" /></span></p>', '2014_02_25_20_02_57-shopmyphamhan-BBCreamFaceItPowerPerfectionSPF37PA++.jpg', NULL, 380000, 'BBTFS03', 1, '0', 0, 0, '1', '1', '1', 1392741013),
(16, 7, 'CC Cream TFS', ' CC Cream Thefaceshop Aura Color Control Cream SPF30 PA++', 'cc-cream-thefaceshop-aura-color-control-cream-spf30-pa', 'Xuất xứ: Thefaceshop - Korea.\r\nCC Cream mỏng, mịn hơn BB cream và khả năng che phủ tốt, mang lại vẻ đẹp tự nhiên.', '<p><span style="font-size: medium; color: #000000;"><a title=" CC Cream Thefaceshop Aura Color Control Cream SPF30 PA++" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/-CC-Cream-Thefaceshop-Aura-Color-Control-Cream-SPF30-PA--"><span style="font-size: medium; color: #000000;">&nbsp;<strong>CC Cream <span style="font-size: medium; color: #000000;">Thefaceshop&nbsp;</span>Aura Color Control Cream SPF30 PA++</strong></span></a></span></p>\r\n<p><span style="font-size: medium; color: #000000;">Trọng lượng : 20g</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><a title=" CC Cream Aura Color" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/-CC-Cream-Thefaceshop-Aura-Color-Control-Cream-SPF30-PA--"><strong>&nbsp;<span style="font-size: medium; color: #000000;">CC Cream</span><span style="font-size: medium; color: #000000;">&nbsp;</span></strong></a><span style="font-size: medium; color: #000000;"><a title=" CC Cream Aura Color" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/-CC-Cream-Thefaceshop-Aura-Color-Control-Cream-SPF30-PA--"><strong>Aura Color</strong></a>&nbsp;</span>l&agrave; một xu hướng trang điểm mới , vượt mặt những g&igrave; BB Cream đang nắm giữ. CC Cream (Color Corrector), được tạm dịch l&agrave; &ldquo;điều chỉnh sắc m&agrave;u&rdquo;, với những vượt trội hơn so với BB Cream:</span></p>\r\n<p><span style="font-size: medium; color: #000000;">CC Cream mỏng, mịn hơn BB cream v&agrave; khả năng che phủ tốt, mang lại vẻ đẹp tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: medium; color: #000000;">CC Cream kết cấu dạng lỏng, mỏng, nhẹ, tạo cảm gi&aacute;c dễ chịu, nhẹ nh&agrave;ng hơn, kh&ocirc;ng g&acirc;y b&iacute; da.</span></p>\r\n<p><span style="font-size: medium; color: #000000;">Nhờ kết cấu lỏng n&ecirc;n </span><a style="font-size: medium;" title="Aura Color Control Cream điều chỉnh sắc da ho&agrave;n hảo" href="/shop/BB-Cream---CC-Cream---Kem-Nen---TFS/-CC-Cream-Thefaceshop-Aura-Color-Control-Cream-SPF30-PA--"><strong>Aura Color Control Cream&nbsp;điều chỉnh sắc da ho&agrave;n hảo</strong></a><span style="font-size: medium; color: #000000;"> hơn so với, nhất l&agrave; những bạn c&oacute; tone m&agrave;u da t&aacute;i xanh hoặc l&agrave;n da ngăm tự nhi&ecirc;n nhi&ecirc;n. V&igrave; c&ocirc;ng dụng của CC Cream l&agrave; điều chỉnh sắc da n&ecirc;n mang đến sự mượt m&agrave; tinh tế trong m&agrave;u sắc. Đặc biệt, bạn c&oacute; thể phối hợp trộn chung với kem nền (Foundation) v&agrave; che khuyết điểm nếu muốn</span></p>\r\n<p><span style="font-size: medium; color: #000000;">CC Cream thừa hưởng hầu như to&agrave;n bộ chức năng dưỡng da của BB cream: c&acirc;n bằng độ ẩm-chống nắng-l&agrave;m trắng da.</span></p>\r\n<p><span style="font-size: medium; color: #000000;">C&oacute; 2 tone m&agrave;u : 01 - m&agrave;u s&aacute;ng v&agrave; 02 - tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: medium; color: #000000;"><img title=" CC Cream Thefaceshop Aura Color Control Cream SPF30 PA++ 1" src="/uploads/img_product_detail/CC-Cream-Aura-Color-Thefaceshop-SPF30-PA%2B%2B.jpg" alt=" CC Cream Thefaceshop Aura Color Control Cream SPF30 PA++ 1" width="640" height="427" /></span></p>\r\n<p><span style="font-size: medium; color: #000000;">&nbsp;</span></p>', '2014_02_25_22_40_33-shopmyphamhan-CCCream AuraColorSPF30PA++.jpg', 440000, 370000, 'CCTFS01', 1, '0', 0, 0, '1', '1', '1', 1392741443),
(17, 18, 'Mascara - Eyeliner - TFS', ' Bột Vẽ Chân Mày Designing Cake Eyebrow Thefaceshop', '-Bot-Ve-Chan-May-Designing-Cake-Eyebrow-Thefaceshop', 'Xuất xứ : Thefaceshop - Korea.\r\nBột vẽ chân mày dạng phấn giúp tạo đôi chân mày thật tự nhiên mà không gây vón cục.', '<div class="TabbedPanelsContentGroup">\r\n<div class="TabbedPanelsContent noidungsanpham TabbedPanelsContentVisible">\r\n<p><strong><span style="font-size: small;">Bột Vẽ Ch&acirc;n M&agrave;y Designing Cake Eyebrow&nbsp;<strong><span>Thefaceshop</span></strong></span></strong></p>\r\n<p><span style="font-size: small;">Trọng lượng : 4g</span></p>\r\n<p><span style="font-size: small;">Bột vẽ ch&acirc;n mày dạng phấn giúp tạo đ&ocirc;i ch&acirc;n mày th&acirc;̣t tự nhi&ecirc;n mà kh&ocirc;ng g&acirc;y vón cục.</span></p>\r\n<p><span style="font-size: small;"><strong>Designing Cake Eyebrow</strong>&nbsp;l&agrave; sản phẩm bột kẻ ch&acirc;n m&agrave;y với độ b&aacute;m m&agrave;u tốt, si&ecirc;u mịn mang lại đ&ocirc;i l&ocirc;ng m&agrave;y tự nhi&ecirc;n v&agrave; mềm mại. Sản phẩm gồm 2 &ocirc; m&agrave;u,th&iacute;ch hợp cho bạn tạo đ&ocirc;i ch&acirc;n m&agrave;y theo &yacute; th&iacute;ch, k&egrave;m theo 2 c&acirc;y cọ nhỏ, 1 để t&aacute;n m&agrave;u v&agrave; 1 để chải m&agrave;y.</span></p>\r\n</div>\r\n</div>\r\n<div class="clear"><span style="font-size: small;">&nbsp;</span></div>\r\n<div><span style="font-size: small;">&nbsp;</span></div>', '2014_02_26_13_05_22-shopmyphamhan-Bot-Ve-Chan-May-Designing-Cake-Eyebrow-Thefaceshop.jpg', 175000, 160000, 'EYEBTFS02', 1, '0', 0, 0, '1', '1', '1', 1392792105),
