(26, 17, 'Phấn Nền - Phấn Phủ - TFS', ' Phấn Phủ Kiềm Dầu Oil Cut Powder Pact SPF25 PA++', 'phn-ph-kim-du-oil-cut-powder-pact-spf25-pa', 'Xuất xứ : Thefaceshop - Korea\r\nPhấn phủ nén kiểm soát lượng dầu vượt trội, giữ bề mặt da khô thoáng không bị bóng nhờn.\r\n', '<p><a title="Phấn Phủ Kiềm Dầu Oil Cut Powder Pact SPF25 PA++" href="/shop/Phan-Nen---Phan-Phu---TFS/phn-ph-kim-du-oil-cut-powder-pact-spf25-pa"><span style="font-size: medium;"><strong>Phấn Phủ Kiềm Dầu Oil Cut Powder Pact SPF25 PA++</strong></span></a></p>\r\n<p><span style="font-size: medium;">Trọng Lượng: 11g</span></p>\r\n<p><span style="font-size: medium;">Đ&acirc;y l&agrave; sản phẩm <a title="phấn phủ dạng n&eacute;n của Thefaceshop d&agrave;nh cho da dầu, hỗn hợp," href="/shop/Phan-Nen---Phan-Phu---TFS/phn-ph-kim-du-oil-cut-powder-pact-spf25-pa"><strong>phấn phủ dạng n&eacute;n của Thefaceshop d&agrave;nh cho da dầu, hỗn hợp</strong>,</a> gi&uacute;p kiểm so&aacute;t sự điều tiết dầu đồng thời bổ sung nước v&agrave; dưỡng chất cần thiết cho da, sản phẩm vừa c&oacute; t&aacute;c dụng trang điểm, vừa c&oacute; t&aacute;c dụng dưỡng da.</span></p>\r\n<p><span style="font-size: medium;"><a title="Oil Cut Powder Pact SPF25 PA++" href="/shop/Phan-Nen---Phan-Phu---TFS/phn-ph-kim-du-oil-cut-powder-pact-spf25-pa"><strong>Oil Cut Powder Pact SPF25 PA++</strong></a>&nbsp;với độ che phủ nhẹ nh&agrave;ng cho lớp trang điểm tự nhi&ecirc;n, mềm mịn!<br /></span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">Hướng Dẫn Sử Dụng:</span></p>\r\n<p><span style="font-size: medium;"> D&ugrave;ng b&ocirc;ng phấn thoa nhẹ nh&agrave;ng tr&ecirc;n to&agrave;n khu&ocirc;n mặt trước rồi thoa v&agrave;o v&ugrave;ng chữ T, tr&aacute;nh miết b&ocirc;ng phấn để tạo độ mịn v&agrave; b&aacute;m phấn hơn.</span></p>\r\n<p><span style="font-size: medium;">Sản phẩm c&oacute; 2 tone:NB21 s&aacute;ng v&agrave; NB23 tự nhi&ecirc;n.</span></p>', '2014_04_01_22_22_21-shopmyphamhan-phan-ph-kiem-dau-oil-cut-powder-