(42, 52, 'Phấn Nén - Pact', 'Carrot Pact - Phấn Phủ Cà Rốt', 'carrot-pact-phn-ph-c-rt', 'Xuất xứ : Skinfood - Korea.\r\nCarrot Pact - Phấn Phủ Cà Rốt thích hợp cho da nhạy cảm.', '<p><a title="Carrot Pact - Phấn Phủ C&agrave; Rốt" href="/shop/phn-nn-pact/carrot-pact-phn-ph-c-rt"><span style="font-size: medium;"><span style="color: #000000;"><strong>Carrot Pact - Phấn Phủ C&agrave; Rốt</strong> </span></span></a></p>\r\n<p><span style="font-size: medium;"><strong>Carrot Pact</strong> l&agrave; sản phẩm <a title="phấn phủ dạng n&eacute;n,với dinh dưỡng chiết xuất từ củ c&agrave; rốt" href="/shop/phn-nn-pact/carrot-pact-phn-ph-c-rt"><strong>phấn phủ dạng n&eacute;n,với dinh dưỡng chiết xuất từ củ c&agrave; rốt</strong></a> được trồng ở đảo Jeju nổi tiếng ở H&agrave;n Quốc. Đ&acirc;y l&agrave; loại phấn phủ tạo lớp trang điểm nhẹ nh&agrave;ng, tự nhi&ecirc;n, tho&aacute;ng m&aacute;t th&iacute;ch hợp cho mọi loại da, đặc biệt l&agrave; <a title="da nhạy cảm!" href="/shop/phn-nn-pact/carrot-pact-phn-ph-c-rt"><strong>da nhạy cảm</strong>!</a></span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">Hướng Dẫn Sử Dụng :</span></p>\r\n<p><span style="font-size: medium;">D&ugrave;ng b&ocirc;ng phấn thoa nhẹ nh&agrave;ng tr&ecirc;n to&agrave;n khu&ocirc;n mặt trước rồi thoa v&agrave;o v&ugrave;ng chữ T, tr&aacute;nh miết b&ocirc;ng phấn để tạo độ mịn v&agrave; b&aacute;m phấn hơn.</span><br /><br /><span style="font-size: medium;">&nbsp;</span><br /><br /></p>', '2014_03_25_21_26_26-shopmyphamhan-carrot-pact-phan-phu-ca-rot.gif', NULL, 245000, 'PPSF03', 0, '0', 0, 1, '0', '1', '1', 1392797023),
(44, 16, 'Che khuyết Điểm - Má Hồng - TFS', 'Phấn Má Hồng Lovely Thefaceshop 04 baby Pink ', 'phn-m-hng-lovely-thefaceshop-04-baby-pink', 'Xuất xứ : Thefaceshop - Korea.\r\nMá hồng với kết cấu bột mịn mang đến phong cách trẻ trung, sôi động.', '<p><span style="font-size: medium;"><strong>Phấn M&aacute; Hồng Lovely&nbsp;Thefaceshop&nbsp;04 baby Pink&nbsp;</strong>&nbsp;&nbsp;</span></p>\r\n<p><span style="font-size: medium;">Đ&acirc;y l&agrave; sản phẩm <strong>phấn m&aacute; hồng dạng n&eacute;n của Thefaceshop</strong>&nbsp;chứa c&aacute;c hạt phấn cực mịn, dễ d&agrave;ng phủ nhẹ bằng cọ trang điểm&nbsp;với m&agrave;u sắc nhẹ nh&agrave;ng trẻ trung v&agrave; c&oacute; t&aacute;c dụng kiềm dầu, giữ cho&nbsp;khu&ocirc;n mặt của bạn kh&ocirc; tho&aacute;ng, ko bị b&oacute;ng nhờn&nbsp;mang lại vẻ ứng hồng tự nhi&ecirc;n như em b&eacute; , cho đ&ocirc;i g&ograve; m&aacute; l&agrave;m cho da mặt bạn th&ecirc;m phẩn tươi trẻ.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch d&ugrave;ng: </span></p>\r\n<p><span style="font-size: medium;">D&ugrave;ng chổi b&ocirc;ng quẹt phấn v&agrave; tản đều tr&ecirc;n v&ugrave;ng m&aacute;.</span></p>', '2014_02_26_15_40_00-shopmyphamhan-Phan-Ma-Hong-LovelyThefaceshop04babyPink.jpg', 125000, 100000, 'MHTFS03', 1, '0', 0, 0, '0', '1', '1', 1392797134),
(46, 57, 'Eyeliner - Kẻ Viền Mắt', 'Kẻ mắt nước chiết xuất quả hạnh (không lem) -Eyeliner Skinfood Sweet Almond ', 'k-mt-nc-chit-xut-qu-hnh-khng-lem-eyeliner-skinfood-sweet-almond', 'Xuất xứ : Skinfood - Korea ', '<p><a title="Eyeliner Skinfood Sweet Almond - Kẻ mắt nước chiết xuất quả hạnh (kh&ocirc;ng lem)" href="/shop/Eyeliner---Mascara---Eyebrow/Ke-mat-nuoc-chiet-xuat-qua-hanh--khong-lem---Eyeliner-Skinfood-Sweet-Almond-"><span style="color: #000000;"><strong><span style="font-size: small;">Eyeliner Skinfood Sweet Almond - Kẻ mắt nước chiết xuất quả hạnh (kh&ocirc;ng lem)</span></strong></span></a><br /><span style="font-size: small; color: #000000;">Dung t&iacute;ch: 7ml</span></p>\r\n<p><span style="font-size: small; color: #000000;"><a title="Kẻ mắt nước chiết xuất tinh dầu quả hạnh Skinfood" href="/shop/Eyeliner---Mascara---Eyebrow/Ke-mat-nuoc-chiet-xuat-qua-hanh--khong-lem---Eyeliner-Skinfood-Sweet-Almond-"><strong>Kẻ mắt nước chiết xuất tinh dầu quả hạnh Skinfood</strong></a> gi&uacute;p l&agrave;m dịu v&ugrave;ng da nhạy cảm quanh mắt, mắt nước c&oacute; t&ocirc;ng m&agrave;u tối tạo n&eacute;t tự nhi&ecirc;n cho đ&ocirc;i mắt, kh&ocirc;ng lem, kh&ocirc;ng tr&ocirc;i.</span><br /><br /><span style="font-size: small; color: #000000;">Hướng dẫn sử dụng:</span><br /><span style="font-size: small; color: #000000;">D&ugrave;ng đầu cọ vẽ nhẹ nh&agrave;ng l&ecirc;n đường viền mắt</span></p>', '2014_02_19_15_10_05-shopmyphamhan-Eyeliner_SWEET_ALMOND.jpg', 150000, 130000, 'LINERSF01', 1, '0', 0, 0, '0', '1', '1', 1392797405),
(49, 70, 'Kem Dưỡng - Cream', 'Kem Dưỡng Chống Thâm Quầng Mắt Cá Hồi Skinfood - Salmon Brightening Eye Cream', 'kem-dng-chng-thm-qung-mt-c-hi-skinfood-salmon-brightening-eye-cream', 'Xuất xứ : Skinfood - Korea.\r\nĐây là sản phẩm kem dưỡng sâu chống quầng thâm mắt chiết xuất từ cá hồi giúp cung cấp độ ẩm cần thiết cho vùng da mắt, làm mất dần quầng thâm mắt, giúp bạn có một khuôn mặt trang điểm rạng rỡ và đẹp hơn.', '<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Trọng Lượng: 30ml</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong><a title="Kem Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood" href="/shop/Duong-Mat---Eye-Cream/Kem-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood---Salmon-Brightening-Eye-Cream">Kem Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood</a></strong> - Salmon Brightening Eye Cream&nbsp;tập trung th&uacute;c đẩy v&agrave; cung cấp omega-3 fatty acid, haloxyl, arbutin v&agrave; vitamins gi&uacute;p m&aacute;u lưu th&ocirc;ng hiệu quả v&agrave; l&agrave;m trắng cho l&agrave;n da v&ugrave;ng mắt s&aacute;ng rạng rỡ đỡ mệt mỏi hơn.</span><br /><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong><a title="Kem Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood" href="/shop/Duong-Mat---Eye-Cream/Kem-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood---Salmon-Brightening-Eye-Cream">Kem Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood</a></strong><span>&nbsp;</span>&nbsp;được đ&aacute;nh gi&aacute; 5* v&agrave; l&agrave; d&ograve;ng sản phẩm h&agrave;ng đầu trong c&aacute;c <strong>mỹ phẩm trị quầng th&acirc;m mắt</strong> khi sử dụng trong v&ograve;ng 2 tuần nh&eacute;!</span><br /><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Hướng Dẫn Sử Dụng:</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Sau khi rửa sạch mặt, nếu c&oacute;, sử dụng toner ( nước hoa hồng ), sau đ&oacute;, lấy một lượng serum vừa đủ thoa l&ecirc;n v&ugrave;ng quanh mắt v&agrave; massage nhẹ nh&agrave;ng để tinh chất thẩm thấu v&agrave;o da một c&aacute;ch tốt nhất. D&ugrave;ng th&ecirc;m kem dưỡng ( c&ugrave;ng bộ ) nếu c&oacute; để đạt được hiệu quả tối ưu nhất ( Khi d&ugrave;ng v&agrave;o buổi tối )!</span></p>', '2014_02_25_12_59_45-shopmyphamhan-kem-duong-mat-ca-hoi.jpg', 420000, 370000, 'EYESF01', 1, '0', 0, 0, '0', '1', '1', 1393161078),
(50, 69, 'Tinh Chất Dưỡng - Serum', 'Serum Dưỡng Chống Thâm Quầng Mắt Cá Hồi Skinfood- Serum Salmon Brightening', 'serum-dng-chng-thm-qung-mt-c-hi-skinfood-serum-salmon-brightening', 'Xuất xứ : Skinfood - Korea.\r\nTinh chất dưỡng chống quầng thâm mắt chiết xuất từ cá hồi giúp cung cấp độ ẩm cần thiết cho vùng da mắt, làm mất dần quầng thâm mắt.', '<p><span style="font-size: medium;"><a title="Serum Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood- Serum Salmon Brightening" href="/shop/Duong-Mat---Eye-Cream/Serum-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood--Salmon-Brightening-"><strong>Serum Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi Skinfood- Serum&nbsp;</strong><strong><span data-mce-mark="1">Salmon Brightening</span></strong></a></span></p>\r\n<p><span style="font-size: medium;">Trọng Lượng: 30g</span></p>\r\n<p><span style="font-size: medium;"><strong style="font-size: small;"><span data-mce-mark="1">Serum Dưỡng Chống Th&acirc;m Quầng Mắt C&aacute; Hồi <a title="Skinfood- Salmon Brightening" href="/shop/Duong-Mat---Eye-Cream/Serum-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood--Salmon-Brightening-">Skinfood- Salmon Brightening</a>&nbsp;</span></strong>tập trung th&uacute;c đẩy v&agrave; cung cấp <a style="font-size: small;" title="omega-3" href="/shop/Duong-Mat---Eye-Cream/Serum-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood--Salmon-Brightening-"><strong>omega-3</strong></a> fatty acid, haloxyl, arbutin v&agrave; vitamins gi&uacute;p m&aacute;u lưu th&ocirc;ng hiệu quả v&agrave; <a style="font-size: small;" title="l&agrave;m trắng cho l&agrave;n da v&ugrave;ng mắt" href="/shop/Duong-Mat---Eye-Cream/Serum-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood--Salmon-Brightening-"><strong>l&agrave;m trắng cho l&agrave;n da v&ugrave;ng mắt</strong></a> s&aacute;ng rạng rỡ đỡ mệt mỏi hơn.</span></p>\r\n<p><span style="font-size: medium;">Sản phẩm được đ&aacute;nh gi&aacute; 5* v&agrave; l&agrave; d&ograve;ng sản phẩm <a title="h&agrave;ng đầu trong c&aacute;c mỹ phẩm trị quầng th&acirc;m mắt" href="/shop/Duong-Mat---Eye-Cream/Serum-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood--Salmon-Brightening-"><strong>h&agrave;ng đầu trong c&aacute;c mỹ phẩm trị quầng th&acirc;m mắt</strong></a> khi sử dụng trong v&ograve;ng 2 tuần nh&eacute;!</span></p>\r\n<p><span style="font-size: medium;">Hướng Dẫn Sử Dụng:</span></p>\r\n<p><span style="font-size: medium;">Sau khi rửa sạch mặt, nếu c&oacute;, sử dụng toner ( nước hoa hồng ), sau đ&oacute;, lấy một lượng serum vừa đủ thoa l&ecirc;n v&ugrave;ng quanh mắt v&agrave; massage nhẹ nh&agrave;ng để tinh chất thẩm thấu v&agrave;o da một c&aacute;ch tốt nhất. D&ugrave;ng th&ecirc;m kem dưỡng ( c&ugrave;ng bộ ) nếu c&oacute; để đạt được hiệu quả tối ưu nhất ( Khi d&ugrave;ng v&agrave;o buổi tối )!</span></p>', '2014_02_28_12_50_44-shopmyphamhan-Serum-Duong-Chong-Tham-Quang-Mat-Ca-Hoi-Skinfood-Salmon-Brightening.jpg', 420000, 345000, 'EYESF02', 1, '0', 0, 0, '0', '1', '1', 1393162018),
(52, 21, 'CC Cream', 'CC Cream Etude house 02 Glow có ánh nhũ', 'cc-cream-etude-house-02-glow-c-nh-nh', 'Xuất xứ : Etude House - Korea.\r\n CC Cream có ánh nhũ ngọc trai mang lại độ căng, mượt và bóng khỏe cho làn da.', '<p><span style="font-size: medium;"><a title="CC Cream Etude house 02 Glow c&oacute; &aacute;nh nhũ" href="/shop/BB-Cream---CC-Cream/CC-Cream-Etude-house-02-Glow-co-anh-nhu"><strong>CC Cream Etude house 02 Glow c&oacute; &aacute;nh nhũ</strong></a></span></p>\r\n<p><span style="font-size: medium;">Trọng lượng : 20g</span></p>\r\n<p><span style="font-size: medium;">Đ&acirc;y<strong>&nbsp;</strong>l&agrave; d&ograve;ng kem trang điểm "th&ocirc;ng minh" - với khả năng tự điều chỉnh sắc m&agrave;u ph&ugrave; hợp với l&agrave;n da người sử dụng - khi mới lấy ra th&igrave; c&oacute; m&agrave;u trắng đục, ngay sau khi thoa l&ecirc;n da th&igrave; ngay lập tức CC Cream sẽ điều chỉnh v&agrave; đổi m&agrave;u sao cho kem l&ecirc;n m&agrave;u ph&ugrave; hợp với da bạn! H&atilde;y sở hữu ngay&nbsp;<a title="CC Cream Etude house 02 Glow" href="/shop/BB-Cream---CC-Cream/CC-Cream-Etude-house-02-Glow-co-anh-nhu"><strong>CC Cream Etude house 02 Glow</strong></a>&nbsp;để c&oacute; l&agrave;n da mịn m&agrave;ng, kh&ocirc; tho&aacute;ng v&agrave; tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium;"><img title="CC Cream Etude house 02 Glow c&oacute; &aacute;nh nhũ 1" src="/uploads/img_product_detail/CCCreamEtudehouse01Silky-khong-anh-nhu0.jpg" alt="CC Cream Etude house 02 Glow c&oacute; &aacute;nh nhũ 1" width="485" height="480" /></span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>', '2014_04_01_21_57_54-shopmyphamhan-cc-cream-etude-house-02-glow-c-nh-nh.jpg', NULL, 300000, 'CCET02', 1, '0', 0, 0, '0', '1', '1', 1393301006);
