(53, 21, 'CC Cream', 'CC Cream Etude house 01 Silky không ánh nhũ', 'cc-cream-etude-house-01-silky-khng-nh-nh', 'CC Cream Etude house - Correct & Care CC Cream 01 Silky mang lại độ mịn cho làn da, không ánh nhũ.', '<p><span style="font-size: medium;"><a title="CC Cream Etude house 01 Silky kh&ocirc;ng &aacute;nh nhũ" href="/shop/BB-Cream---CC-Cream/CC-Cream-Etude-house-01-Silky-khong-anh-nhu"><strong>CC Cream Etude house 01 Silky kh&ocirc;ng &aacute;nh nhũ</strong></a></span></p>\r\n<p><span style="font-size: medium;">Trọng lượng : 20g</span></p>\r\n<p><span style="font-size: medium;">Đ&acirc;y l&agrave; d&ograve;ng kem trang điểm "th&ocirc;ng minh" - với khả năng tự điều chỉnh sắc m&agrave;u ph&ugrave; hợp với l&agrave;n da người sử dụng - khi mới lấy ra th&igrave; c&oacute; m&agrave;u trắng đục, ngay sau khi thoa l&ecirc;n da th&igrave; ngay lập tức CC Cream sẽ điều chỉnh v&agrave; đổi m&agrave;u sao cho kem l&ecirc;n m&agrave;u ph&ugrave; hợp với da bạn! H&atilde;y sở hữu ngay <a title="CC Cream Etude house 01 Silky" href="/shop/BB-Cream---CC-Cream/CC-Cream-Etude-house-01-Silky-khong-anh-nhu"><strong>CC Cream Etude house&nbsp;01 Silky&nbsp;</strong></a>để c&oacute; l&agrave;n da mịn m&agrave;ng, kh&ocirc; tho&aacute;ng v&agrave; tự nhi&ecirc;n.</span></p>\r\n<p><span style="font-size: medium;"><img title="CC Cream Etude house 01 silky khong anh nhu 1" src="/uploads/img_product_detail/CCCreamEtudehouse01Silky-khong-anh-nhu0.jpg" alt="CC Cream Etude house 01 silky khong anh nhu 1" width="485" height="480" /></span></p>\r\n<p><span style="font-size: medium;">&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp;</span></p>', '2014_04_01_21_54_13-shopmyphamhan-cc-cream-etude-house-01-silky-khng-nh-nh.jpg', NULL, 300000, 'CCET01', 1, '0', 0, 0, '0', '1', '1', 1393301383),
(54, 59, 'Son Môi - Lipstick', 'Son Etude House Color Lips Fit', 'son-etude-house-color-lips-fit', 'Xuất xứ : Etude House - Korea.\r\n', '<p><a title="Son Etude House Color Lips Fit" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Color-Lips-Fit"><strong><span style="font-size: small;">Son Etude House Color Lips Fit</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng lượng : 10g</span></p>\r\n<p><span style="font-size: small;">D&ograve;ng son mới ra mắt ng&agrave;y 1 th&aacute;ng 2 năm 2014 n&agrave;y.M&agrave;u son độ b&oacute;ng v&agrave; mịn cao.<strong><span style="font-size: small;">&nbsp;<a title="Color Lips Fit" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Color-Lips-Fit">Color Lips Fit</a></span></strong> dạng lỏng nhưng m&agrave;u l&ecirc;n th&igrave; lại cảm gi&aacute;c rất đặc,m&ugrave;i thơm nhẹ nh&agrave;ng ,đặc biệt ko kh&ocirc; m&ocirc;i v&agrave; che phủ mọi khuyết điểm của m&ocirc;i , độ b&aacute;m d&iacute;nh tr&ecirc;n cả tuyệt vời.</span></p>\r\n<p><span style="font-size: small;"><img title="Son Etude House Color Lips Fit 1" src="/uploads/img_product_detail/SonEtudeHouseColorLipsFit-0.jpg" alt="Son Etude House Color Lips Fit 1" width="693" height="960" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2014_02_25_15_44_25-shopmyphamhan-SonEtudeHouseColorLipsFit.jpg', NULL, 190000, 'SONET1', 1, '0', 0, 0, '0', '1', '1', 1393317865),
(55, 61, 'Son Tint', 'Son Etude House Rosy Tint Lips', 'son-etude-house-rosy-tint-lips', 'Xuất xứ : Etude House - Korea.', '<p><a title="Son Etude House Rosy Tint Lips" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Rosy-Tint-Lips"><strong><span style="font-size: small;">Son Etude House Rosy Tint Lips</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng lượng tịnh: 9g</span></p>\r\n<p><span style="font-size: small;">- Son tint với thiết kế đầu m&uacute;t dạ dễ d&agrave;ng sử dụng.</span></p>\r\n<p><span style="font-size: small;">- Nằm trong thiết kế mới nhất <strong>"Rose Make-up Collection"</strong> 2013 của <a title="Son Etude House" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Rosy-Tint-Lips"><strong>Son Etude House</strong></a>.</span></p>\r\n<p><span style="font-size: small;">- <a title="Son dạng kem velvet Rosy" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Rosy-Tint-Lips"><strong>Son dạng kem velvet Rosy</strong></a>, được mệnh danh l&agrave; velvet tint.</span></p>\r\n<p><span style="font-size: small;">- Dạng son l&igrave; nhưng cung cấp nhiều dưỡng v&agrave; duy tr&igrave; độ ẩm tốt.</span><br /><br /></p>\r\n<p><span style="font-size: small;"><img title="Son Etude House Rosy Tint Lips 1" src="/uploads/img_product_detail/Son-Etude-House-Rosy-Tint-Lips.jpg" alt="Son Etude House Rosy Tint Lips 1" width="698" height="522" /></span></p>', '2014_02_25_16_00_37-shopmyphamhan-SonEtudeHouseRosyTintLips.jpg', NULL, 175000, 'SONET2', 1, '0', 0, 0, '0', '1', '1', 1393318672),
(56, 59, 'Son Môi - Lipstick', 'Son Etude House Vivid Pop Stick', 'son-etude-house-vivid-pop-stick', 'Xuất xứ : Etude House - Korea.', '<p><a title="Son Etude House Vivid Pop Stick" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Vivid-Pop-Stick"><strong><span style="font-size: small;">Son Etude House Vivid Pop Stick</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng Lượng: 2.4g</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm son m&ocirc;i dạng s&aacute;p b&uacute;t ch&igrave;, với những gam m&agrave;u tươi trẻ v&agrave; rực rỡ c&ugrave;ng độ b&aacute;m m&agrave;u tốt, kết cấu son mềm mịn nhẹ nh&agrave;ng sử dụng cho cả l&ograve;ng m&ocirc;i hoặc nguy&ecirc;n m&ocirc;i t&ugrave;y theo phong c&aacute;ch make up của bạn. </span></p>\r\n<p><span style="font-size: small;"><a title="Son S&aacute;p Etude House Vivid Pop Stick" href="/shop/Son-Moi---Son-Duong/Son-Etude-House-Vivid-Pop-Stick"><strong><span style="font-size: small;">Son S&aacute;p Etude House Vivid Pop Stick</span></strong></a>&nbsp;c&ograve;n v&ocirc; c&ugrave;ng tiện lợi cho bạn g&aacute;i khi mang đi chơi với h&igrave;nh d&aacute;ng c&acirc;y b&uacute;t xinh xắn, c&oacute; thể vặn l&ecirc;n vặn xuống.</span></p>\r\n<p><span style="font-size: small;">C&oacute; c&aacute;c m&agrave;u 2,3,5,7,8.</span></p>\r\n<p><span style="font-size: small;"><img title="Son Etude House Vivid Pop Stick 1" src="/uploads/img_product_detail/SonVividPopStick00.jpg" alt="Son Etude House Vivid Pop Stick 1" width="688" height="880" /></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2014_02_25_16_58_29-shopmyphamhan-Son-Etude-House-vivid-pop-stick.jpg', NULL, 165000, 'SONET3', 1, '0', 0, 0, '0', '1', '1', 1393322309),
(57, 60, 'Son Dưỡng - Lip care', 'Son Dưỡng Etude House Kissful Lip Care Essence ', 'son-dng-etude-house-kissful-lip-care-essence', 'Xuất xứ : Etude House - Korea.', '<p><a title="Son Dưỡng Etude House Kissful Lip Care Essence " href="/shop/son-dng-lip-care/son-dng-etude-house-kissful-lip-care-essence"><strong><span style="font-size: small;">Son Dưỡng Etude House Kissful Lip Care Essence&nbsp;</span></strong></a></p>\r\n<p><span style="font-size: small;">Trọng Lượng: 10g.</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm tinh chất dưỡng m&ocirc;i <a title="tăng cường dưỡng ẩm cho đ&ocirc;i m&ocirc;i kh&ocirc;" href="/shop/son-dng-lip-care/son-dng-etude-house-kissful-lip-care-essence">tăng cường dưỡng ẩm cho đ&ocirc;i m&ocirc;i kh&ocirc;</a>, mang lại cho đ&ocirc;i m&ocirc;i sự mềm mịn, mượt m&agrave;!</span></p>\r\n<p>&nbsp;</p>', '2014_02_25_17_09_05-shopmyphamhan-Son-DuongEtudeHouseKissfulLipCareEssence.jpg', NULL, 120000, 'SONET4', 1, '0', 0, 0, '0', '1', '1', 1393322945),
(58, 60, 'Son Dưỡng - Lip care', 'Tẩy Da Chết Môi Etude House Kissful Lip Scrub', 'ty-da-cht-mi-etude-house-kissful-lip-scrub', 'Xuất xứ : Etude House - Korea.\r\nTẩy tế bào chết cho môi chiết xuất thiên nhiên từ tinh chất trái cây, đường đen', '<p><strong><span style="font-size: small;">Tẩy Da Chết M&ocirc;i Etude House Kissful Lip Scrub</span></strong></p>\r\n<p><span style="font-size: small;">Trọng Lượng: 10g</span></p>\r\n<p><span style="font-size: small;">Đ&acirc;y l&agrave; sản phẩm tẩy tế b&agrave;o chết cho m&ocirc;i chiết xuất thi&ecirc;n nhi&ecirc;n từ tinh chất tr&aacute;i c&acirc;y, đường đen với những hạt sần gi&uacute;p tẩy da chết tr&ecirc;n m&ocirc;i rất hiệu quả với m&ugrave;i hương cực quyến rũ m&ugrave;i kẹo, tr&aacute;i c&acirc;y v&agrave; vị ngọt nhẹ nh&agrave;ng để lại sau khi sử dụng đ&atilde; l&agrave;m m&ecirc; mệt c&aacute;c bạn g&aacute;i H&agrave;n!</span></p>\r\n<p><span style="font-size: small;"><strong>K</strong><span style="font-size: small;"><strong>issful Lip Care Lip Scrub</strong> c&oacute; tinh chất dưỡng s&aacute;ng da m&ocirc;i rất th&iacute;ch hợp sử dụng <strong>cho c&aacute;c bạn g&aacute;i c&oacute; m&agrave;u da m&ocirc;i sẫm, bị th&acirc;m</strong> do sử dụng son nhiều v&agrave; m&ocirc;i bị bong tr&oacute;c, kh&ocirc; nẻ...</span></span></p>\r\n<p><span style="font-size: small;"><span style="font-size: small;"><span style="text-decoration: underline;">Hướng Dẫn Sử Dụng:</span></span></span></p>\r\n<p><span style="font-size: small;"><span style="font-size: small;">Lấy 1 lượng vừa đủ thoa l&ecirc;n m&ocirc;i, nhẹ nh&agrave;ng massage trong 1-2 ph&uacute;t rồi rửa lại bằng nước hoặc lau sạch bằng khăn. Sau đ&oacute; thoa Lip Balm hoặc Lip Essence để dưỡng m&ocirc;i.</span></span></p>', '2014_02_25_17_21_46-shopmyphamhan-Tay-Da-Chet-Moi-EtudeHouse-Kissful-Lip-Scrub.jpg', NULL, 120000, 'SONET5', 1, '0', 0, 0, '0', '1', '1', 1393323706),
(59, 73, 'Lanopearl', 'Kem dưỡng tinh dầu đà điểu Re-Birth Emu Anti-wrinkle Cream 100ml', 'kem-dng-tinh-du--iu-re-birth-emu-anti-wrinkle-cream-100ml', 'Xuất xứ : Lanopearl - Australia.\r\nThành phần chính: Tinh dầu đà điểu, AHA, vitamin và lanolin giúp dưỡng ẩm sâu và cải thiện độ sáng cho da.\r\n', '<h2><span style="text-decoration: underline;">Kem dưỡng tinh dầu đ&agrave; điểu Re-Birth Emu Anti-wrinkle Cream 100ml</span></h2>\r\n<p><span style="font-size: small;"><strong>Kem dưỡng chống nhăn với tinh dầu đ&agrave; điểu</strong> &amp; AHA RE-BIRTH Emu Anti-wrinkle Cream With AHA l&agrave; liệu ph&aacute;p nu&ocirc;i dưỡng l&yacute; tưởng d&agrave;nh cho l&agrave;n da, gi&uacute;p dưỡng ẩm s&acirc;u v&agrave; cải thiện độ trắng s&aacute;ng của l&agrave;n da, cho l&agrave;n da ng&agrave;y c&agrave;ng mềm mượt v&agrave; rạng rỡ tr&agrave;n đầy sức sống.</span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch d&ugrave;ng:</span></span></p>\r\n<p><span style="font-size: small;">Lấy một lượng sản phẩm vừa đủ, d&ugrave;ng ng&oacute;n tay chấm sản phẩm l&ecirc;n tr&aacute;n, mũi, hai b&ecirc;n m&aacute; v&agrave; cằm, sau đ&oacute; thoa đều ra to&agrave;n bộ khu&ocirc;n mặt theo chuyển động tr&ograve;n. Vỗ nhẹ để sản phẩm hấp thu ho&agrave;n to&agrave;n. Sử dụng mỗi s&aacute;ng v&agrave; tối.</span></p>', '2014_02_25_19_19_48-shopmyphamhan-Kem-Duong-Tinh-Dau-Da-Dieu-ReBirth-Emu-Antiwrinkle-Cream-100ml.jpg', 420000, 350000, 'NTC3', 1, '0', 0, 0, '0', '1', '1', 1393330788),
(60, 73, 'Lanopearl', 'Kem dưỡng chiết xuất nhau thai cừu Re-Birth Placenta Anti-wrinkle Cream 100ml', 'kem-dng-chit-xut-nhau-thai-cu-re-birth-placenta-anti-wrinkle-cream-100ml', 'Xuất xứ : Lanopearl - Australia. \r\nThành phần chính: Chiết xuất từ nhau thai, vitamin E và lanolin giúp dưỡng ẩm sâu và ngăn ngừa sự xuất hiện của các nếp nhăn cũng như đốm sạm trên da.', '<h2><a title="Kem dưỡng chiết xuất nhau thai cừu Re-Birth Placenta Anti-wrinkle Cream 100ml" href="/shop/Nhau-Thai-Cuu/Kem-duong-chiet-xuat-nhau-thai-cuu-Re-Birth-Placenta-Anti-wrinkle-Cream-100ml"><span style="font-size: small;">Kem dưỡng chiết xuất nhau thai cừu Re-Birth Placenta Anti-wrinkle Cream 100ml</span></a></h2>\r\n<p><span style="font-size: small;">Dung lượng : 100ml.</span></p>\r\n<p><span style="font-size: small;"><a title="Kem dưỡng chống nhăn" href="/shop/Nhau-Thai-Cuu/Kem-duong-chiet-xuat-nhau-thai-cuu-Re-Birth-Placenta-Anti-wrinkle-Cream-100ml"><strong>Kem dưỡng chống nhăn</strong></a> với chiết xuất nhau thai cừu <a title="RE-BIRTH Placenta Anti-wrinkle Cream" href="/shop/Nhau-Thai-Cuu/Kem-duong-chiet-xuat-nhau-thai-cuu-Re-Birth-Placenta-Anti-wrinkle-Cream-100ml"><strong>RE-BIRTH Placenta Anti-wrinkle Cream</strong></a> l&agrave; liệu ph&aacute;p nu&ocirc;i dưỡng l&yacute; tưởng d&agrave;nh cho l&agrave;n da , gi&uacute;p dưỡng ẩm s&acirc;u v&agrave; <a title="ngăn ngừa sự xuất hiện của c&aacute;c nếp nhăn" href="/shop/Nhau-Thai-Cuu/Kem-duong-chiet-xuat-nhau-thai-cuu-Re-Birth-Placenta-Anti-wrinkle-Cream-100ml"><strong>ngăn ngừa sự xuất hiện của c&aacute;c nếp nhăn</strong></a> cũng như đốm sạm tr&ecirc;n da, duy tr&igrave; l&agrave;n da khỏe mạnh v&agrave; trẻ trung d&agrave;i l&acirc;u.</span></p>\r\n<p>&nbsp;<span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch d&ugrave;ng :</span></span></p>\r\n<p><span style="font-size: small;">Lấy một lượng sản phẩm vừa đủ, d&ugrave;ng ng&oacute;n tay chấm sản phẩm l&ecirc;n tr&aacute;n, mũi, hai b&ecirc;n m&aacute; v&agrave; cằm, sau đ&oacute; thoa đều ra to&agrave;n bộ khu&ocirc;n mặt theo chuyển động tr&ograve;n. Vỗ nhẹ để sản phẩm hấp thu ho&agrave;n to&agrave;n. Sử dụng mỗi s&aacute;ng v&agrave; tối.</span></p>\r\n<p>&nbsp;</p>', '2014_02_25_19_31_45-shopmyphamhan-Kem-Duong-Chiet-Xuat-Nhau-Thai-Cuu-ReBirth-Placenta-Antiwrinkle-Cream.jpg', 420000, 350000, 'NTC4', 1, '0', 0, 0, '0', '1', '1', 1393331505),
(71, 9, 'Son Môi - TFS', 'Son Face It Artist Touch Lipstick Lesson03 Moisture OR201', 'son-face-it-artist-touch-lipstick-lesson03-moisture-or201', 'Xuất xứ : Thefaceshop - Korea. \r\nSon môi với độ dưỡng cao giúp làn môi mềm mại và mịn màng hơn nhờ chiết xuất từ lựu và rau má. ', '<p><span style="font-size: medium;"><strong><strong><strong>Son Face It Artist Touch Lipstick Lesson03</strong></strong>&nbsp;Moisture OR201</strong></span></p>\r\n<p><span style="font-size: medium;">Trọng lượng : 3,5g.</span></p>\r\n<p><span style="font-size: medium;"><strong>Son m&ocirc;i Lesson với độ dưỡng cao</strong> gi&uacute;p l&agrave;n m&ocirc;i mềm mại v&agrave; mịn m&agrave;ng hơn nhờ chiết xuất từ lựu v&agrave; rau m&aacute;. </span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">Hướng Dẫn Sử Dụng :</span></p>\r\n<p><span style="font-size: medium;">D&ugrave;ng cọ hoặc thoa trực ti&ecirc;́p l&ecirc;n m&ocirc;i. </span></p>', '2014_02_27_13_46_02-shopmyphamhan-Son-Lesson03-Thefaceshop-Moisture-OR201.jpg', NULL, 180000, 'SONMTFS1', 1, '0', 0, 0, '0', '1', '1', 1393483563),
