(79, 65, 'Lột Mụn - Peel Off', 'Lột Mụn Volcanic Clay Black Head Charcoal Nose Strip', 'lt-mn-volcanic-clay-black-head-charcoal-nose-strip', 'Xuất xứ : Thefaceshop - Korea.\r\nMặt nạ dành riêng cho vùng mũi giúp loại bỏ mụn đầu đen hoàn hảo. Bổ sung than hoạt tính giúp thanh lọc da.', '<p><span style="font-size: medium;"><strong>Lột Mụn Volcanic Clay Black Head Charcoal Nose Strip&nbsp;</strong></span></p>\r\n<p><span style="font-size: medium;">Số lượng : 7 miếng</span></p>\r\n<p><span style="font-size: medium;">Đ&acirc;y l&agrave; sản phẩm mặt nạ dạng <strong>miếng lột d&agrave;nh cho v&ugrave;ng mũi chiết xuất từ than hoạt t&iacute;nh v&agrave; tro n&uacute;i lửa</strong> ở New Zealand - một trong những khu vực n&uacute;i lửa lớn nhất tr&ecirc;n thế giới.</span></p>\r\n<p><span style="font-size: medium;"><strong>Volcanic Clay Black Head Charcoal Thefaceshop&nbsp;</strong>c&oacute; t&aacute;c dụng l&agrave;m mềm da, <strong>se lỗ ch&acirc;n l&ocirc;ng</strong> gi&uacute;p lỗ ch&acirc;n l&ocirc;ng th&ocirc;ng tho&aacute;ng v&agrave; sạch mụn đầu đen cho v&ugrave;ng mũi của bạn sẽ l&aacute;ng mịn hơn, kh&ocirc;ng c&ograve;n nỗi lo về dầu v&agrave; mụn.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">Hướng Dẫn Sử Dụng :</span></p>\r\n<p><span style="font-size: medium;">Cho một &iacute;t nước l&ecirc;n v&ugrave;ng da mũi, sau đ&oacute; đắp mặt nạ l&ecirc;n v&ugrave;ng mũi, để kh&ocirc; v&agrave; lột nhẹ từ 2 b&ecirc;n m&eacute;p. Lau lại bằng nước hoa hồng cho hiệu quả se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng.</span></p>\r\n<p><span style="font-size: medium;"><img title="Lột Mụn Volcanic Clay Black Head Charcoal Nose Strip 1" src="/uploads/img_product_detail/Lot-Mun-Volcanic-Clay-Black-Head-Nose-Strip.jpg" alt="Lột Mụn Volcanic Clay Black Head Charcoal Nose Strip 1" width="596" height="472" /></span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>', '2014_