(81, 62, 'Mặt Nạ Miếng - Sheet', 'Mặt Nạ Lựu Thefaceshop Real Nature Mask Pomegranate ', 'mt-n-lu-thefaceshop-real-nature-mask-pomegranate', 'Xuất xứ : Thefaceshop - Korea.\r\nMặt nạ giấy chiết xuất từ lựu chống lão hóa.', '<p><span style="font-size: medium;"><strong>Mặt Nạ Lựu Thefaceshop Real Nature Mask Pomegranate&nbsp;</strong></span></p>\r\n<p><span style="font-size: medium;"><strong>Mask Pomegranate</strong> tổng hợp lượng kho&aacute;ng chất phong ph&uacute;, mỗi g&oacute;i chứa đến 1,000mg <strong>lựu thi&ecirc;n nhi&ecirc;n chống l&atilde;o h&oacute;a cho da</strong>.</span></p>\r\n<p><span style="font-size: medium;"><strong>Mặt nạ giấy chiết xuất từ lựu</strong> gi&uacute;p <strong>cải thiện độ đ&agrave;n hồi</strong> v&agrave; độ ẩm cho l&agrave;n da.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Sử dụng sau bước l&agrave;m sạch da v&agrave; thoa nước c&acirc;n bằng. Đắp mặt nạ khoảng 10 đến 12 ph&uacute;t. Sau khi l&acirc;́y mặt nạ ra, d&ugrave;ng đầu ng&oacute;n tay vỗ nhẹ để sản phẩm thẩm thấu v&agrave;o da.</span></p>', '2014_03_02_21_51_28-shopmyphamhan-Mat-na-luu-thefaceshop-real_nature_mask_sheet_pomegranate.jpg', 35000, 25000, 'MASKTFS3', 1, '0', 0, 0, '0', '1', '1', 1393522330),
