(95, 62, 'Mặt Nạ Miếng - Sheet', 'Mặt Nạ Tre Thefaceshop Real Nature Mask Bamboo', 'mt-n-tre-thefaceshop-real-nature-mask-bamboo', 'Xuất xứ : Thefaceshop - Korea.\r\nMặt Nạ Tre thích hợp cho da khô, da nhạy cảm.', '<p><a title="Mặt Nạ Tre Thefaceshop Real Nature Mask Bamboo" href="/shop/mt-n-ming-sheet/mt-n-tre-thefaceshop-real-nature-mask-bamboo"><span style="font-size: medium;"><strong>Mặt Nạ Tre Thefaceshop Real Nature Mask Bamboo</strong></span></a></p>\r\n<p><span style="font-size: medium;"><a title="Mask Bamboo" href="/shop/mt-n-ming-sheet/mt-n-tre-thefaceshop-real-nature-mask-bamboo"><strong><strong>Mask Bamboo </strong></strong></a>tổng hợp lượng kho&aacute;ng chất phong ph&uacute;, mỗi g&oacute;i chứa đến 1,150mg<strong><strong>&nbsp;<a title="Tre gi&uacute;p da tươi trẻ, thanh khiết cho da kh&ocirc;, da nhạy cảm." href="/shop/mt-n-ming-sheet/mt-n-tre-thefaceshop-real-nature-mask-bamboo">Tre&nbsp;gi&uacute;p da tươi trẻ, thanh khiết&nbsp;cho da kh&ocirc;, da nhạy cảm.</a></strong></strong></span></p>\r\n<p><span style="font-size: medium;"><a title="Mặt nạ giấy với chiết xuất từ tre" href="/shop/mt-n-ming-sheet/mt-n-tre-thefaceshop-real-nature-mask-bamboo"><strong>Mặt nạ giấy với chiết xuất từ tre</strong></a> gi&uacute;p cung cấp kho&aacute;ng chất v&agrave; thanh lọc da.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch sử dụng</span></p>\r\n<p><span style="font-size: medium;">Sử dụng sau bước l&agrave;m sạch da v&agrave; thoa nước c&acirc;n bằng. Đắp mặt nạ khoảng 10 đến 12 ph&uacute;t. Sau khi l&acirc;́y mặt nạ ra, d&ugrave;ng đầu ng&oacute;n tay vỗ nhẹ để sản phẩm thẩm thấu v&agrave;o da.</span></p>', '2014_04_06_18_59_02-shopmyphamhan-mat-na-tre-thefaceshop-real-nature-mask-bamboo.jpg', 35000, 25000, 'MASKTFS15', 1, '0', 0, 0, '0', '1', '1', 1393565963),
(96, 34, 'Sữa Rửa Mặt - Cleansing Foam', 'Sữa Rửa Mặt Gạo Rice Water Bright Cleansing Foam', 'sa-ra-mt-go-rice-water-bright-cleansing-foam', 'Xuất xứ : Thefaceshop - Korea.\r\nSữa Rửa Mặt Gạo làm sạch và sáng da, lưu lại độ ẩm cho da.', '<p><a title="Sữa Rửa Mặt Gạo Rice Water Bright Cleansing Foam" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-water-bright-cleansing-foam"><span style="font-size: medium;"><strong>Sữa Rửa Mặt Gạo Rice Water Bright Cleansing Foam</strong></span></a></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch : 150ml.</span></p>\r\n<p><span style="font-size: medium;">Rice Water Bright Cleansing Foam<strong>&nbsp;</strong>l&agrave; sản phẩm <a title="sữa rửa mặt chiết xuất từ nước gạo" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-water-bright-cleansing-foam"><strong>sữa rửa mặt chiết xuất từ nước gạo</strong></a> v&agrave; dầu thực vật Moringa, gi&uacute;p lấy sạch ho&agrave;n to&agrave;n bụi bẩn v&agrave; b&atilde; nhờn s&acirc;u trong lỗ ch&acirc;n l&ocirc;ng cho l&agrave;n sạch v&agrave; s&aacute;ng khỏe. Với kết cấu dạng kem mịn, dễ tạo bọt, tạo cảm gi&aacute;c trơn l&aacute;ng, mềm mịn sau khi rửa mặt.</span></p>\r\n<p><span style="font-size: medium;"><a title="Sữa rửa mặt gạo Thefaceshop" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-water-bright-cleansing-foam"><strong>Sữa rửa mặt gạo Thefaceshop</strong></a> gi&uacute;p <strong><a title=" l&agrave;m sạch v&agrave; s&aacute;ng da" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-water-bright-cleansing-foam">l&agrave;m sạch v&agrave; s&aacute;ng da</a>,</strong> lưu lại đ&ocirc;̣ &acirc;̉m cho da sau khi sử dụng.</span></p>\r\n<p><span style="font-size: medium;">C&aacute;ch sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Sử dụng sau tẩy trang. Tạo bọt sản phẩm, massage khoảng 30 gi&acirc;y đến 1 ph&uacute;t v&agrave; rửa sạch lại với nước</span></p>', '2014_02_28_13_47_03-shopmyphamhan-Sua-rua-mat-gao-rice-water-bright-cleansing-foam.jpg', NULL, 165000, 'SRMTFS1', 1, '0', 0, 0, '1', '1', '1', 1393566376),
(97, 34, 'Sữa Rửa Mặt - Cleansing Foam', 'Sữa Rửa Mặt Gạo Rice Warer Bright Rice Bran Cleansing Foam', 'sa-ra-mt-go-rice-warer-bright-rice-bran-cleansing-foam', 'Xuất xứ : Thefaceshop - Korea.\r\nSữa Rửa Mặt Gạo loại bỏ tế bào chết và làm sạch, sáng da.', '<p><span style="font-size: medium;"><a title="Sữa Rửa Mặt Gạo Rice Warer Bright Rice Bran Cleansing Foam" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-warer-bright-rice-bran-cleansing-foam"><strong>Sữa Rửa Mặt Gạo Rice Warer Bright Rice Bran Cleansing Foam</strong></a></span></p>\r\n<p><span style="font-size: medium;"><a title="Sữa rửa mặt gạo gi&uacute;p loại bỏ t&ecirc;́ bào ch&ecirc;́t" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-warer-bright-rice-bran-cleansing-foam"><strong>Sữa rửa mặt gạo gi&uacute;p loại bỏ t&ecirc;́ bào ch&ecirc;́t</strong></a> nhẹ nhàng,<a style="font-size: small;" title="l&agrave;m sạch v&agrave; s&aacute;ng da" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-go-rice-warer-bright-rice-bran-cleansing-foam"><strong> l&agrave;m sạch v&agrave; s&aacute;ng da</strong></a>, lưu lại đ&ocirc;̣ &acirc;̉m cho da sau khi sử dụng.</span></p>\r\n<p><span style="font-size: medium;">C&aacute;ch sử dụng:&nbsp;</span></p>\r\n<p><span style="font-size: medium;">Sử dụng sau tẩy trang. Tạo bọt sản phẩm, massage khoảng 30 gi&acirc;y đến 1 ph&uacute;t v&agrave; rửa sạch lại với nước.</span></p>', '2014_02_28_13_49_53-shopmyphamhan-Sua-rua-mat-gao-rice-water-bright-rice-bran-cleansing-foam.jpg', NULL, 185000, 'SRMTFS2', 1, '0', 0, 0, '0', '1', '1', 1393567001),
(98, 34, 'Sữa Rửa Mặt - Cleansing Foam', 'Sữa rửa mặt trắng da White Tree Snow Exfoliating Foam Cleanser', 'sa-ra-mt-trng-da-white-tree-snow-exfoliating-foam-cleanser', 'Xuất xứ : Thefaceshop - Korea.\r\nSữa rửa mặt White Tree Snow làm sạch tế bào chết và làm trắng da.', '<p><a title="Sữa rửa mặt trắng da White Tree Snow Exfoliating Foam Cleanser" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-trng-da-white-tree-snow-exfoliating-foam-cleanser"><strong><span style="font-size: small;">Sữa rửa mặt trắng da White Tree Snow Exfoliating Foam Cleanser</span></strong></a></p>\r\n<p><span style="font-size: small;">Dung t&iacute;ch : 140ml.</span></p>\r\n<p><span style="font-size: small;"><span><a title="White Tree Snow" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-trng-da-white-tree-snow-exfoliating-foam-cleanser"><strong>White Tree Snow</strong></a>&nbsp;</span>chiết xuất từ c&aacute;c th&agrave;nh phần:</span></p>\r\n<p><span style="font-size: small;">- C&acirc;y Vitamin chứa: Vitamin C (Gấp 200 lần lượng vitamin C trong 1 tr&aacute;i t&aacute;o). Gi&uacute;p da phục hồi t&iacute;nh đ&agrave;n hồi, loại bỏ tế b&agrave;o chết nhẹ nh&agrave;ng, ph&ograve;ng ngừa nếp nhăn xuất hiện. <a title="Ngăn ngừa v&agrave; loại trừ vết th&acirc;m đen" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-trng-da-white-tree-snow-exfoliating-foam-cleanser"><strong>Ngăn ngừa v&agrave; loại trừ vết th&acirc;m đen</strong></a>, loại trừ c&aacute;c sắc tố ra ngo&agrave;i cơ thể, mang lại l&agrave;n da sang mịn v&agrave; khỏe mạnh; 18 ax&iacute;t amin thiết yếu, axit tr&aacute;i c&acirc;y gi&uacute;p điều ho&agrave; lại v&ograve;ng tuần ho&agrave;n</span></p>\r\n<p><span style="font-size: small;">- Flavonoid gi&uacute;p chống lại qu&aacute; tr&igrave;nh oxy ho&aacute;.</span></p>\r\n<p><span style="font-size: small;">- Arbutin: Chiết xuất từ c&acirc;y dương mai, l&agrave; th&agrave;nh phần l&agrave;m trắng da nổi tiếng.</span></p>\r\n<p><span style="font-size: small;">Sữa rửa mặt có hạt giúp<a title=" l&agrave;m sạch tế b&agrave;o chết" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-trng-da-white-tree-snow-exfoliating-foam-cleanser"> <strong>l&agrave;m sạch tế b&agrave;o chết</strong></a> nhẹ nhàng v&agrave;<a title=" l&agrave;m trắng s&aacute;ng da." href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-trng-da-white-tree-snow-exfoliating-foam-cleanser"> <strong>l&agrave;m trắng s&aacute;ng da.</strong></a></span></p>\r\n<p><span style="text-decoration: underline;"><span style="font-size: small;">C&aacute;ch sử dụng :</span></span></p>\r\n<p><span style="font-size: small;">Sử dụng sau tẩy trang. Tạo bọt sản phẩm, massage khoảng 30 gi&acirc;y đến 1 ph&uacute;t v&agrave; rửa sạch lại với nước.</span></p>', '2014_02_28_13_57_41-shopmyphamhan-Sua-rua-mat-Trang-da-white-tree-snow-exfoliating-foam-cleanser.jpg', NULL, 180000, 'SRMTFS3', 1, '0', 0, 0, '1', '1', '1', 1393567416),
(100, 34, 'Sữa Rửa Mặt - Cleansing Foam', 'Sữa Rửa Mặt Than Đen Phyto Powder In Cleasing Foam - Charcoal', 'sa-ra-mt-than-en-phyto-powder-in-cleasing-foam-charcoal', 'Xuất xứ : Thefaceshop - Korea.\r\nSữa Rửa Mặt Than Đen thích hợp cho da dầu, da hỗn hợp.', '<p><span style="font-size: medium;"><a title="Sữa Rửa Mặt Than Đen Phyto Powder In Cleasing Foam - Charcoal" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-than-en-phyto-powder-in-cleasing-foam-charcoal"><strong>Sữa Rửa Mặt Than Đen Phyto Powder In Cleasing Foam - Charcoal</strong></a></span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 170ml.</span></p>\r\n<p><span style="font-size: medium;">Sữa rửa mặt Thefaceshop<a title=" với thành ph&acirc;̀n b&ocirc;̣t than hoạt tính" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-than-en-phyto-powder-in-cleasing-foam-charcoal"><strong> với thành ph&acirc;̀n b&ocirc;̣t than hoạt tính</strong></a> k&ecirc;́t c&acirc;́u r&ocirc;̃ng giúp <a title="thanh lọc c&aacute;c ch&acirc;́t b&acirc;̉n và đ&ocirc;̣c t&ocirc;́ tr&ecirc;n da" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-than-en-phyto-powder-in-cleasing-foam-charcoal"><strong>thanh lọc c&aacute;c ch&acirc;́t b&acirc;̉n và đ&ocirc;̣c t&ocirc;́ tr&ecirc;n da</strong></a>, cùng các hạt than hoạt tính giúp<a title=" làm sạch mụn đầu đen v&agrave; t&ecirc;́ bào ch&ecirc;́t" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-than-en-phyto-powder-in-cleasing-foam-charcoal"> <strong>làm sạch mụn đầu đen v&agrave; t&ecirc;́ bào ch&ecirc;́t</strong></a> nhẹ nhàng, đem lại làn da tươi sáng.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch sử dụng</span></p>\r\n<p><span style="font-size: medium;">Lấy một lượng vừa đủ ra l&ograve;ng b&agrave;n tay v&agrave; tạo bọt kỹ. Thoa đ&ecirc;̀u nhẹ nhàng giúp làm sạch bụi b&acirc;̉n tr&ecirc;n da. Rửa sạch kỹ với nước.</span></p>', '2014_02_28_13_55_03-shopmyphamhan-Sua-rua-mat-than-den-phyto-powder-in-cleansi