(101, 34, 'Sữa Rửa Mặt - Cleansing Foam', 'Sữa Rửa Mặt Calming Seed Mild Bubble Foam Cleanser', 'sa-ra-mt-calming-seed-mild-bubble-foam-cleanser', 'Xuất xứ : Thefaceshop - Korea.\r\nSữa rửa mặt Calming Seed cho da nhạy cảm.', '<p><a title="Sữa Rửa Mặt Calming Seed Mild Bubble Foam Cleanser" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-calming-seed-mild-bubble-foam-cleanser"><span style="font-size: medium;"><strong>Sữa Rửa Mặt Calming Seed Mild Bubble Foam Cleanser</strong></span></a></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch : 150ml</span></p>\r\n<p><span style="font-size: medium;">Sữa rửa mặt <a title="Calming Seed l&agrave;m sạch v&agrave; mịn da" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-calming-seed-mild-bubble-foam-cleanser"><strong>Calming Seed l&agrave;m sạch v&agrave; mịn da</strong></a> với chiết xuất từ hạt m&ugrave; u (tanamu) v&agrave; <strong><a title="cam thảo gi&uacute;p l&agrave;m dịu v&agrave; ngăn ngừa k&iacute;ch ứng" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-calming-seed-mild-bubble-foam-cleanser">cam thảo gi&uacute;p l&agrave;m dịu v&agrave; ngăn ngừa k&iacute;ch ứng</a> </strong>cho l&agrave;n da.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Dùng m&ocirc;̣t lượng vừa đủ tạo bọt và m&aacute;t xa nhẹ nhàng khắp bề mặt da. Rửa sạch với nước &acirc;́m.</span></p>', '2014_02_28_13_44_28-shopmyphamhan-Sua-rua-mat-Calming-seed-Mild-Bubble-foam-Cleanser.jpg', NULL, 220000, 'SRMTFS5', 1, '0', 0, 0, '0', '1', '1', 1393568482),
(102, 63, 'Mặt Nạ Dưỡng - Wash off', 'Mặt Nạ Trứng Skinfood Egg White Pore  Mask ', 'mt-n-trng-skinfood-egg-white-pore-mask', 'Xuất xứ : SKinfood - Korea.\r\nMặt Nạ Trứng se khít lỗ chân lông.\r\n', '<p><a title="Mặt Nạ Trứng Skinfood Egg White Pore  Mask" href="/shop/mt-n-dng-wash-off/mt-n-trng-skinfood-egg-white-pore-mask"><span style="font-size: medium;"><strong>Mặt Nạ Trứng Skinfood Egg White Pore&nbsp; Mask </strong></span></a></p>\r\n<p><span style="font-size: medium;">Trọng lượng: 100g</span></p>\r\n<p><a style="font-size: medium;" title="Egg White Pore  Mask với chiết xuất l&ograve;ng trắng trứng" href="/shop/mt-n-dng-wash-off/mt-n-trng-skinfood-egg-white-pore-mask"><strong>Egg White Pore&nbsp; Mask&nbsp;với chiết xuất l&ograve;ng trắng trứng</strong></a><span style="font-size: medium;"> gi&uacute;p thẩm thấu s&acirc;u v&agrave;o lỗ ch&acirc;n l&ocirc;ng </span><a style="font-size: medium;" title="loại bỏ dầu nhờn" href="/shop/mt-n-dng-wash-off/mt-n-trng-skinfood-egg-white-pore-mask"><strong>loại bỏ dầu nhờn</strong></a><span style="font-size: medium;"> g&acirc;y tắc lỗ ch&acirc;n l&ocirc;ng, đồng thời </span><strong style="font-size: medium;"><a style="font-size: medium;" title="l&agrave;m da th&ecirc;m mịn m&agrave;ng." href="/shop/mt-n-dng-wash-off/mt-n-trng-skinfood-egg-white-pore-mask">l&agrave;m da th&ecirc;m mịn m&agrave;ng.</a></strong></p>\r\n<p><span style="font-size: medium;">[C&acirc;u chuyện&nbsp; l&ograve;ng trắng trứng]</span></p>\r\n<p><span style="font-size: medium;">L&ograve;ng trắng trứng, gi&agrave;u albumin, tăng độ săn chắc, đ&agrave;n hồi cho da v&agrave; thu nhỏ lỗ ch&acirc;n l&ocirc;ng.</span></p>\r\n<p><span style="font-size: medium;">Hướng dẫn sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Sau khi rửa mặt sạch, thoa một lượng vừa đủ l&ecirc;n da mặt tr&aacute;nh v&ugrave;ng mắt v&agrave; miệng. Sau 10- 15 ph&uacute;t rửa lại bằng nước ấm.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;"><img title="Mặt