(103, 63, 'Mặt Nạ Dưỡng - Wash off', 'Mặt Nạ Đường Đen Và Dâu Tây Skinfood Black Sugar Strawberry Mask ', 'mt-n-ng-en-v-du-ty-skinfood-black-sugar-strawberry-mask', 'Xuất xứ : SKinfood - Korea. \r\nMặt nạ giúp nhẹ nhàng tẩy tế bào chết, loại bỏ mụn đầu đen, mang lại làn da mềm mại và mịn màng.\r\n', '<p><strong><span style="font-size: medium;"><a title="Mặt Nạ Đường Đen V&agrave; D&acirc;u T&acirc;y Skinfood Black Sugar Strawberry Mask" href="/shop/mt-n-dng-wash-off/mt-n-ng-en-v-du-ty-skinfood-black-sugar-strawberry-mask">Mặt Nạ Đường Đen V&agrave; D&acirc;u T&acirc;y Skinfood Black Sugar Strawberry Mask</a></span></strong></p>\r\n<p><span style="font-size: medium;">Trọng lượng : 100g.</span></p>\r\n<p><span style="font-size: medium;">Sản phẩm b&aacute;n chạy nhất &ldquo;Black Sugar mask Wash Off&rdquo; được kết hợp đường đen với d&acirc;u t&acirc;y tươi ngon ngọt cho hiệu quả cao! Mặt nạ&nbsp;</span><span style="font-size: medium;">gi&uacute;p nhẹ nh&agrave;ng tẩy tế b&agrave;o chết đồng thời mang lại l&agrave;n da mềm mại v&agrave; mịn m&agrave;ng.</span></p>\r\n<p><span style="font-size: medium;">Th&agrave;nh phần:</span></p>\r\n<p><span style="font-size: medium;"><a title="Đường đen Bzazil hữu cơ" href="/shop/mt-n-dng-wash-off/mt-n-ng-en-v-du-ty-skinfood-black-sugar-strawberry-mask"><strong>Đường đen Bzazil hữu cơ</strong></a>: dồi d&agrave;o kho&aacute;ng chất v&agrave; vitamin, <a title="Tẩy tế b&agrave;o chết v&agrave; giữ ẩm cho da, Loại bỏ mụn đầu đen, v&agrave; gi&uacute;p t&aacute;i tạo da." href="/shop/mt-n-dng-wash-off/mt-n-ng-en-v-du-ty-skinfood-black-sugar-strawberry-mask"><strong>Tẩy tế b&agrave;o chết v&agrave; giữ ẩm cho da, Loại bỏ mụn đầu đen, v&agrave; gi&uacute;p t&aacute;i tạo da.</strong></a></span></p>\r\n<p><span style="font-size: medium;"><a title="Hạt d&acirc;u rừng:" href="/shop/mt-n-dng-wash-off/mt-n-ng-en-v-du-ty-skinfood-black-sugar-strawberry-mask"><strong>Hạt d&acirc;u rừng:</strong></a> Gi&uacute;p tẩy tế b&agrave;o chết một c&aacu