(113, 63, 'Mặt Nạ Dưỡng - Wash off', 'Mặt Nạ Bùn Thefaceshop Lovely Meex Pore Ghassoul Mask ', 'mt-n-bn-thefaceshop-lovely-meex-pore-ghassoul-mask', 'Xuất xứ : Thefaceshop - Korea.\r\nMặt Nạ Bùn làm sạch lỗ chân lông thích hợp cho da dầu.', '<p><span style="font-size: medium;"><strong>Mặt Nạ B&ugrave;n Thefaceshop Lovely Meex Pore Ghassoul Mask</strong> </span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 60ml.</span></p>\r\n<p><span style="font-size: medium;">Mặt nạ rửa giúp <strong>ki&ecirc;̉m soát d&acirc;̀u,</strong> làm <strong>sạch s&acirc;u l&ocirc;̃ ch&acirc;n l&ocirc;ng v&agrave; mụn đầu đen</strong> với chi&ecirc;́t xu&acirc;́t <strong>từ Trà Xanh, bùn Ghassoul</strong>. Đem lại làn da tươi sáng và láng mịn.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Sử dụng sau nước c&acirc;n bằng. Dùng lượng sản ph&acirc;̉m vừa đủ và thoa đ&ecirc;̀u khắp mặt (tránh vùng mắt và m&ocirc;i). Đ&ecirc;̉ mặt nạ từ 5 ~ 10 phút, sau đó rửa sạch với nước &acirc;́m.</span><br /><br /></p>', '2014_03_02_22_16_16-shopmyphamhan-Mat-na-bun-thefaceshop-Lovely-Me-ex-mini-pore-Ghassoul-mask.jpg', NULL, 150000, 'MASKDDTFS1', 1, '0', 0, 0, '0', '1', '1', 1393772481),
(114, 63, 'Mặt Nạ Dưỡng - Wash off', 'Mặt Nạ Trị Mụn Thefaceshop Lovely Meex Magic Pink Powder Mask', 'mt-n-tr-mn-thefaceshop-lovely-meex-magic-pink-powder-mask', 'Xuất xứ : Thefaceshop - Korea.\r\nMặt nạ thích hợp cho da mụn, da dầu.', '<p><span style="font-size: medium;"><strong>Mặt Nạ Trị Mụn Thefaceshop Lovely Meex Magic Pink Powder Mask</strong> </span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch : 60ml.</span></p>\r\n<p><span style="font-size: medium;">Mặt nạ rửa <strong>làm dịu các n&ocirc;́t mụn</strong> và có khả năng <strong>kháng vi&ecirc;m</strong> Thefaceshop với thành ph&acirc;̀n Calamine và BHA, <strong>kiểm so&aacute;t b&atilde; nhờn</strong>.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Sử dụng sau nước c&acirc;n bằng. Dùng lượng sản ph&acirc;̉m vừa đủ và thoa đ&ecirc;̀u khắp mặt (tránh vùng mắt và m&ocirc;i). Đ&ecirc;̉ mặt nạ từ 5 ~ 10 phút, sau đó rửa sạch với nước &acirc;́m.</span><br /><br /></p>', '2014_03_02_22_15_06-shopmyphamhan-mat-na-tr-mun-thefaceshop-LOVELY-MEEX-WATERFUL-GRAPEFRUIT-MASK.jpg', NULL, 150000, 'MASKDDTFS2', 1, '0', 0, 0, '0', '1', '1', 1393772729),
(115, 63, 'Mặt Nạ Dưỡng - Wash off', 'Mặt Nạ Ngủ Bưởi Thefaceshop Lovely Meex Waterful Grapefruit Mask ', 'mt-n-ng-bi-thefaceshop-lovely-meex-waterful-grapefruit-mask', 'Xuất xứ : Thefaceshop - Korea.\r\nMặt Nạ Ngủ Bưởi cung cấp ẩm cho da khô.', '<p><span style="font-size: medium;"><strong>Mặt Nạ Ngủ Bưởi Thefaceshop Lovely Meex Waterful Grapefruit Mask</strong> </span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 60ml.</span></p>\r\n<p><span style="font-size: medium;"><strong>Mặt nạ ngủ giúp làm sáng da </strong>và phục h&ocirc;̀i<strong> đ&ocirc;̣ &acirc;̉m cho da </strong>với<strong> chi&ecirc;́t xu&acirc;́t từ Bưởi</strong>, c&acirc;y Vitamin và Chanh. Đem lại làn da tươi sáng rạng rỡ.</span></p>\r\n<p><span style="font-size: medium;"><span style="text-decoration: underline;">C&aacute;ch sử dụng</span>:</span></p>\r\n<p><span style="font-size: medium;">Sử dụng sau nước c&acirc;n bằng. Dùng lượng sản ph&acirc;̉m vừa đủ và thoa đ&ecirc;̀u khắp mặt (tránh vùng mắt và m&ocirc;i). Đ&ecirc;̉ mặt nạ đ&ecirc;́n sáng h&ocirc;m sau và rửa lại với nước &acirc;́m.</span><br /><br /></p>', '2014_03_02_22_13_46-shopmyphamhan-Mat-na-ngu-buoi-thefaceshop-Lovely-meex-mini-waterful-grapefruit-mask.jpg', NULL, 150000, 'MASKDDTFS3', 1, '0', 0, 0, '0', '1', '1', 1393772934),
(116, 77, 'Kem Chống Nắng', 'Kem Chống Nắng Toàn Thân Thefaceshop Natural Sun Aq Body & Family Mild Sun Milk SPF40 PA+++ ', 'kem-chng-nng-ton-thn-thefaceshop-natural-sun-aq-body-family-mild-sun-milk-spf40-pa', 'Xuất Xứ : Thefaceshop - korea.\r\nKem Chống Nắng Toàn Thân chiết xuất từ acaiberry và hạt argan.', '<p><span style="font-size: medium;"><strong>Kem Chống Nắng To&agrave;n Th&acirc;n Thefaceshop Natural Sun Aq Body &amp; Family Mild Sun Milk SPF40 PA+++ </strong></span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 50ml.</span></p>\r\n<p><span style="font-size: medium;"><strong>Sữa chống nắng cho da cơ thể v&agrave; gia đ&igrave;nh Thefaceshop</strong> kh&ocirc;ng g&acirc;y kh&oacute; chịu, nhờn r&iacute;t trong suốt thời gian ngo&agrave;i trời. Chiết xuất từ acaiberry v&agrave; hạt argan.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Thoa trước 30 ph&uacute;t khi ra nắng. Sử dụng sau c&aacute;c bước dưỡng da v&agrave; trước khi trang điểm.</span><br /><br /></p>', '2014_03_02_23_27_26-shopmyphamhan-Kem-Chong-Nang-Toan-Than-Thefaceshop-Natural-Sun-Aq-Body---Family-Mild-Sun-Milk-SPF40-PA+++.jpg', NULL, 270000, 'KCNTFS1', 1, '0', 0, 0, '0', '1', '1', 1393773985),
(117, 77, 'Kem Chống Nắng', 'Kem Chống Nắng Thefaceshop Natural Sun Ultra Protection Sun Cream SPF50 PA+++', 'kem-chng-nng-thefaceshop-natural-sun-ultra-protection-sun-cream-spf50-pa', 'Xuất Xứ : Thefaceshop - korea.\r\nKem Chống Nắng dạng lỏng chống mồ hôi, giúp trắng da.', '<p><span style="font-size: medium;"><strong>Kem Chống Nắng Thefaceshop Natural Sun Ultra Protection Sun Cream SPF50 PA+++</strong></span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch : 50ml.</span></p>\r\n<p style="text-align: left;"><span style="font-size: medium;"><strong>Natural Sun Ultra Protection Sun Cream SPF50 PA+++ l&agrave; một loại kem chống nắng dạng lỏng</strong> để ngăn chặn tia UV, chống mồ h&ocirc;i, gi&uacute;p trắng da (c&oacute; chứa c&aacute;c th&agrave;nh phần Asai-Berry). Sản phẩm mới chống nắng v&agrave; chăm s&oacute;c da từ c&aacute;c th&agrave;nh phần hữu cơ tự nhi&ecirc;n, thảo mộc kh&ocirc;ng g&acirc;y k&iacute;ch ứng da.</span><br /><br /><span style="font-size: medium;"><strong>Chống nắng SPF 50+ PA+++</strong> hiệu quả tuyệt đối với tia UVA/UVB.</span><br /><br /><span style="font-size: medium;">Bảo vệ da ho&agrave;n to&agrave;n dưới &aacute;nh nắng mặt trời, th&iacute;ch hợp với người l&agrave;m việc l&acirc;u dưới &aacute;nh nắng hoặc du lịch biển.</span></p>\r\n<p style="text-align: left;"><span style="font-size: medium;">&nbsp;</span></p>', '2014_03_02_23_25_05-shopmyphamhan-Kem-Chong-Nang-Thefaceshop-Natural-Sun-Ultra-Protection-Sun-Cream-SPF50-PA+++.jpg', 250000, 220000, 'KCNTFS2', 1, '0', 0, 0, '0', '1', '1', 1393774536),
(118, 78, 'Xịt Khoáng - Mist', 'Xịt Khoáng Thefaceshop Pure Water Facial Mist - Jeju Marine ', 'xt-khong-thefaceshop-pure-water-facial-mist-jeju-marine', 'Xuất Xứ : Thefaceshop - korea.\r\n', '<p><span style="font-size: medium;"><strong>Xịt Kho&aacute;ng Thefaceshop Pure Water Facial Mist - Jeju Marine </strong></span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch : 50ml.</span></p>\r\n<p><span style="font-size: medium;">Kho&aacute;ng xịt Thefaceshop gi&uacute;p cung cấp và phục h&ocirc;̀i lượng nước cần thiết cho l&agrave;n da bạn, b&ocirc;̉ sung <strong>nước tinh khi&ecirc;́t từ đảo Jeju</strong>, đem lại cảm giác tươi mát tức thì.</span></p>\r\n<p><span style="text-decoration: underline; font-size: medium;">C&aacute;ch sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Để sản phẩm c&aacute;ch xa mặt khoảng 30~ 40 cm v&agrave; xịt nhẹ khắp v&ugrave;ng mặt.</span><br /><br /></p>', '2014_03_02_23_22_19-shopmyphamhan-Xit-khoang-Thefaceshop-Pure-Water-Facial-Mist-Jeju-Marine.jpg', NULL, 115000, 'MISTTFS1', 1, '0', 0, 0, '0', '1', '1', 1393774754);
