(119, 59, 'Son Môi - Lipstick', 'Son Môi Vita Tok Lipstick RD01', 'son-mi-vita-tok-lipstick-rd01', 'Xuất xứ : Skinfood - Korea.\r\nVita Tok Lipstick RD01 (Cherry Drink).', '<p><a title="Son M&ocirc;i Vita Tok Lipstick RD01" href="/shop/son-mi-lipstick/son-mi-vita-tok-lipstick-rd01"><strong><span style="font-size: small;">Son M&ocirc;i Vita Tok Lipstick RD01</span></strong></a></p>\r\n<p><span style="font-size: small;"><a title="Son Vita Tok Skinfood" href="/shop/son-mi-lipstick/son-mi-vita-tok-lipstick-rd01"><strong>Son Vita Tok Skinfood</strong></a> chứa nhiều vitamin <a title="dưỡng ẩm" href="/shop/son-mi-lipstick/son-mi-vita-tok-lipstick-rd01"><strong>dưỡng ẩm</strong></a>,&nbsp;gi&uacute;p cho bạn c&oacute; bờ m&ocirc;i căng mọng, lấp l&aacute;nh.</span><br /><br /><span style="font-size: small;"><span style="font-size: small;">Hướng dẫn sử dụng:</span></span><br /><br /><span style="font-size: small;">- M&ocirc;i b&uacute;p b&ecirc;: Thoa b&ecirc;n trong l&ograve;ng m&ocirc;i v&agrave; bặm nhẹ hai m&ocirc;i lại với nhau gi&uacute;p m&ocirc;i tr&ocirc;ng tự nhi&ecirc;n.</span><br /><br /><span style="font-size: small;">- M&ocirc;i quyến rũ: Thoa một lớp l&ecirc;n to&agrave;n bộ v&ugrave;ng m&ocirc;i cho bạn bờ m&ocirc;i quyến rũ.</span><br /><br /></p>\r\n<p><img title="Son M&ocirc;i Vita Tok Lipstick RD01 1" src="/uploads/img_product_detail/Son-M%C3%B4i-Vita-Tok-Lipstick-RD01-0.jpg" alt="Son M&ocirc;i Vita Tok Lipstick RD01 1" width="500" height="500" /></p>', '2014_03_03_10_10_23-shopmyphamhan-Son-Môi-Vita-Tok-Lipstick-RD01.jpg', NULL, 180000, 'SMSF1', 1, '0', 0, 0, '0', '1', '1', 1393816162),
(120, 59, 'Son Môi - Lipstick', 'Son Môi Vita Tok Skinfood Lipstick PK01', 'son-mi-vita-tok-skinfood-lipstick-pk01', 'Xuất xứ : Skinfood - Korea.\r\nVita Tok Lipstick PK01 (Dorothy Berry).', '<p><a title="Son M&ocirc;i Vita Tok Skinfood Lipstick PK01" href="/shop/son-mi-lipstick/son-mi-vita-tok-skinfood-lipstick-pk01"><strong><span style="font-size: small;">Son M&ocirc;i Vita Tok Skinfood Lipstick PK01</span></strong></a></p>\r\n<p><span style="font-size: small;">Son <a title="Vita Tok Skinfood Berry" href="/shop/son-mi-lipstick/son-mi-vita-tok-skinfood-lipstick-pk01"><strong><span style="font-size: small;">Vita Tok Skinfood</span>&nbsp;Berry</strong></a> chứa nhiều vitamin dưỡng ẩm gi&uacute;pcho bạn c&oacute; bờ m&ocirc;i căng mọng, lấp l&aacute;nh.</span><br /><br /><span style="text-decoration: underline;"><span style="font-size: small;">Hướng dẫn sử dụng:</span></span><br /><br /><span style="font-size: small;">- M&ocirc;i b&uacute;p b&ecirc;: Thoa b&ecirc;n trong l&ograve;ng m&ocirc;i v&agrave; bặm nhẹ hai m&ocirc;i lại với nhau gi&uacute;p m&ocirc;i tr&ocirc;ng tự nhi&ecirc;n.</span><br /><br /><span style="font-size: small;">- M&ocirc;i quyến rũ: Thoa một lớp l&ecirc;n to&agrave;n bộ v&ugrave;ng m&ocirc;i cho bạn bờ m&ocirc;i quyến rũ.</span></p>\r\n<p><span style="font-size: small;"><img title="Son M&ocirc;i Vita Tok Skinfood Lipstick PK01 1" src="/uploads/img_product_detail/Son-moi-Vita-Tok-Skinfood-Lipstick-PK01-0.jpg" alt="Son M&ocirc;i Vita Tok Skinfood Lipstick PK01 1" width="410" height="400" /></span></p>', '2014_03_03_10_18_56-shopmyphamhan-Son-moi-Vita-Tok-Skinfood-Lipstick-PK01.jpg', NULL, 180000, 'SMSF2', 1, '0', 0, 0, '0', '1', '1', 1393816445),
(121, 61, 'Son Tint', 'Son Tomato Smoothie Tint Skinfood 01 ', 'son-tomato-smoothie-tint-skinfood-01', 'Xuất xứ : Skinfood - Korea.\r\nSon môi dưỡng ẩm chiết xuất cà chua Số 1 Red Tomato: màu bưởi đỏ cho cái nhìn tự nhiên đầy gợi cảm.', '<p><a title="Son Tomato Smoothie Tint Skinfood 01 " href="/shop/son-tint/son-tomato-smoothie-tint-skinfood-01"><strong><span style="font-size: small;">Son Tomato Smoothie Tint Skinfood 01 </span></strong></a><br /><br /><span style="font-size: small;">Trọng lượng: 5g</span><br /><br /><span style="font-size: small;"><a title="Son m&ocirc;i dưỡng ẩm chiết xuất c&agrave; chua" href="/shop/son-tint/son-tomato-smoothie-tint-skinfood-01"><strong><span style="font-size: small;">Son m&ocirc;i dưỡng ẩm chiết xuất c&agrave; chua</span> </strong></a>mềm mịn cho đ&ocirc;i m&ocirc;i gợi cảm, đồng thời bảo vệ v&agrave; dưỡng ẩm cho m&ocirc;i với th&agrave;nh phần <a title="dưỡng ẩm tự nhi&ecirc;n từ c&agrave; chua" href="/shop/son-tint/son-tomato-smoothie-tint-skinfood-01"><strong>dưỡng ẩm tự nhi&ecirc;n từ c&agrave; chua</strong></a>.</span></p>\r\n<p><span style="font-size: small;">Số 1 Red Tomato: m&agrave;u bưởi đỏ cho c&aacute;i nh&igrave;n tự nhi&ecirc;n đầy gợi cảm</span><br /><br /><span style="text-decoration: underline;"><span style="font-size: small;">Hướng dẫn sử dụng:</span></span></p>\r\n<p><span style="font-size: small;">1. Thoa đều l&ecirc;n m&ocirc;i</span></p>\r\n<p><span style="font-size: small;">2. Thoa th&ecirc;m lần nữa v&agrave;o v&ugrave;ng giữa m&ocirc;i dưới cho đ&ocirc;i m&ocirc;i đầy đặn v&agrave; quyến rũ hơn.</span><br /><br /></p>', '2014_03_03_10_24_36-shopmyphamhan-Son-Tomato-Smoothie-Tint-Skinfood-01.jpg', NULL, 130000, 'SMSF3', 1, '0', 0, 0, '0', '1', '1', 1393817077),
(122, 64, 'Tẩy Da Chết - Peeling', 'Tẩy da chết Ngọc Trai Thefaceshop White Jewel Smart Peeling  ', 't-y-da-cht-ngc-trai-thefaceshop-white-jewel-smart-peeling', 'Xuất xứ : Thefaceshop - Korea.\r\nTẩy tế bào chết Ngọc Trai tác dụng làm trắng da.', '<p><span style="font-size: medium;"><strong>T<a title="Kem t&acirc;̉y da chết Ngọc Trai Thefaceshop White Jewel Smart Peeling " href="/shop/ty-da-cht-peeling/kem-t-y-da-cht-ngc-trai-thefaceshop-white-jewel-smart-peeling">&acirc;̉y da chết Ngọc Trai Thefaceshop White Jewel Smart Peeling&nbsp; </a></strong></span></p>\r\n<p><span style="font-size: medium;">Trọng lượng: 120ml</span></p>\r\n<p><span style="font-size: medium;">White Jewel Smart Peeling được <a title="pha trộn với bột ngọc trai nhẹ nh&agrave;ng loại bỏ tế b&agrave;o da cũ" href="/shop/ty-da-cht-peeling/kem-t-y-da-cht-ngc-trai-thefaceshop-white-jewel-smart-peeling"><strong>pha trộn với bột ngọc trai nhẹ nh&agrave;ng loại bỏ tế b&agrave;o da cũ</strong></a> v&agrave; c&aacute;c tạp chất m&agrave; ẩn s&acirc;u b&ecirc;n trong lỗ ch&acirc;n l&ocirc;ng để tăng cường sự hấp thu tốt hơn về dinh dưỡng cung cấp chăm s&oacute;c l&agrave;n da của bạn. Tuần ho&agrave;n m&aacute;u của bạn sẽ được cải thiện từ massage v&ograve;ng tr&ograve;n ,sau khi sử dụng <a title="l&agrave;n da của bạn sẽ trắng s&aacute;ng" href="/shop/ty-da-cht-peeling/kem-t-y-da-cht-ngc-trai-thefaceshop-white-jewel-smart-peeling"><strong>l&agrave;n da của bạn sẽ trắng s&aacute;ng</strong></a> l&ecirc;n với &aacute;nh s&aacute;ng tự nhi&ecirc;n l&agrave;nh mạnh.</span><br /><br /><span style="font-size: medium;">Hướng dẫn sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Lấy kem vừa đủ v&agrave; xoa b&oacute;p tr&ecirc;n da bạn từ 3 ~ 5 ph&uacute;t (tr&aacute;nh mắt v&agrave; m&ocirc;i). Rửa sạch với nước. Tr&aacute;nh c&aacute;c vết thương v&agrave; ph&aacute;t ban.</span></p>\r\n<p><span style="font-size: medium;">- Đối với da dầu, sử dụng 1 ~ 2 lần mỗi tuần.</span></p>\r\n<p><span style="font-size: medium;">- Đối với da thường, da kh&ocirc; sử dụng mỗi tuần một lần.</span></p>\r\n<p><span style="font-size: medium;">- Massage thường xuy&ecirc;n (bằng c&aacute;ch sử dụng chỉ mục của bạn v&agrave; ng&oacute;n tay giữa &aacute;p suất tối ưu):</span></p>\r\n<p><span style="font-size: medium;">+ Bước 1 (để cải thiện nếp nhăn xung quanh khu vực m&ocirc;i): nhẹ nh&agrave;ng đặt &aacute;p lực l&ecirc;n khu vực giữa m&ocirc;i v&agrave; cằm cho 5 lần.</span></p>\r\n<p><span style="font-size: medium;">+ Bước 2 (để cải thiện nếp nhăn tr&ecirc;n da): nhẹ nh&agrave;ng đặt &aacute;p lực l&ecirc;n c&aacute;c khu vực ngay b&ecirc;n dưới khu vực ng&ocirc;i đền của bạn cho 5 lần.</span></p>\r\n<p><span style="font-size: medium;">+ Bước 3 (để giảm d&ograve;ng s&acirc;u tr&ecirc;n tr&aacute;n của bạn): nhẹ nh&agrave;ng đặt &aacute;p lực l&ecirc;n khu vực giữa l&ocirc;ng m&agrave;y của bạn cho 5 lần.</span></p>\r\n<p><span style="font-size: medium;">+ Bước 4 (cho khu&ocirc;n mặt h&igrave;nh chữ V): nhẹ nh&agrave;ng massage từ cả hai g&oacute;c của đ&ocirc;i m&ocirc;i của bạn của bạn tr&ecirc;n khu vực ngay b&ecirc;n dưới khu vực ng&ocirc;i đền của bạn cho 5 lần.</span></p>\r\n<p><span style="font-size: medium;">+ Bước 5 (để tr&aacute;nh ph&ugrave; nề mặt): Đặt bốn ng&oacute;n tay lại với nhau, bắt đầu massage từ sườn n&uacute;i mũi đ&ocirc;i tai của bạn</span><br /><br /></p>', '2014_03_03_10_45_57-shopmyphamhan-Tay-te-bao-chet-Ngoc-Trai-Thefaceshop-White-Jewel.jpg', NULL, 160000, 'TDCTFS1', 1, '0', 0, 0, '0', '1', '1', 1393817731),
(123, 64, 'Tẩy Da Chết - Peeling', 'Tẩy da chết táo xanh Thefaceshop Jelly Apple Peeling  ', 'ty-da-cht-to-xanh-thefaceshop-jelly-apple-peeling', 'Xuất xứ : Thefaceshop - Korea.\r\nKem tẩy da chết táo xanh loại bỏ hiệu quả mụn đầu đen', '<p><span style="font-size: medium;"><strong>T<a title="Kem tẩy da chết t&aacute;o xanh Thefaceshop Jelly Apple Peeling " href="/shop/ty-da-cht-peeling/kem-ty-da-cht-to-xanh-thefaceshop-jelly-apple-peeling">ẩy da chết t&aacute;o xanh Thefaceshop Jelly Apple Peeling&nbsp; </a></strong></span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch : 120ml.</span></p>\r\n<p><span style="font-size: medium;">Jelly Apple Peeling được chiết xuất từ t&aacute;o xanh gi&uacute;p cung cấp một lượng lớn chất dinh dưỡng nu&ocirc;i dưỡng da, tăng cường độ ẩm, l&agrave;m mềm v&agrave; l&agrave;m sạch ra, <a title="nhẹ nh&agrave;ng loại bỏ c&aacute;c tế b&agrave;o chết tr&ecirc;n mặt." href="/shop/ty-da-cht-peeling/kem-ty-da-cht-to-xanh-thefaceshop-jelly-apple-peeling"><strong>nhẹ nh&agrave;ng loại bỏ c&aacute;c tế b&agrave;o chết tr&ecirc;n mặt</strong>.</a> Kem c&ograve;n c&oacute; t&aacute;c dụng chống vi khuẩn, gi&uacute;p l&agrave;n da sạch mụn.</span><br /><br /><span style="font-size: medium;">Kem tẩy da chết t&aacute;o xanh Thefaceshop <a title="loại bỏ hiệu quả mụn đầu đen" href="/shop/ty-da-cht-peeling/kem-ty-da-cht-to-xanh-thefaceshop-jelly-apple-peeling"><strong>loại bỏ hiệu quả mụn đầu đen</strong></a>, l&agrave;m cho l&agrave;n da mịn m&agrave;ng, c&oacute; thể l&agrave;m sạch c&aacute;c tế b&agrave;o d&agrave;y sừng,k&iacute;ch hoạt sự hoạt động của da, để lại l&agrave;n da rạng rỡ v&agrave; thu nhỏ lỗ ch&acirc;n l&ocirc;n.</span><br /><br /><span style="font-size: medium;">Với lớp gel c&oacute; thể loại bỏ c&aacute;c lớp sừng,xuất hiện tr&ecirc;n bề mặt da,tẩy đi c&aacute;c da chết ,đồng thời l&agrave;m th&ocirc;ng tho&aacute;ng lỗ ch&acirc;n l&ocirc;ng,th&uacute;c đẩy c&aacute;c mạch m&aacute;u hoạt động l&agrave;m cho l&agrave;n da th&ocirc;ng tho&aacute;ng v&agrave; ng&agrave;y c&agrave;ng mịn m&agrave;ng ,dễ d&agrave;ng hấp thu c&aacute;c loại chất dưỡng da kh&aacute;c</span><br /><br /><span style="font-size: medium;">Hướng dẫn sử dụng:</span><br /><br /><span style="font-size: medium;">Lấy kem vừa đủ v&agrave; xoa b&oacute;p tr&ecirc;n da bạn từ 3 ~ 5 ph&uacute;t (tr&aacute;nh mắt v&agrave; m&ocirc;i). Rửa sạch với nước.</span><br /><br /></p>', '2014_03_03_10_43_45-shopmyphamhan-Kem-tay-da-chet-tao-xanh-thefaceshop-Jelly-Apple-Peeling.JPG', NULL, 160000, 'TDCTFS2', 1, '0', 0, 0, '0', '1', '1', 1393818225),
(124, 64, 'Tẩy Da Chết - Peeling', 'Tẩy Da Chết Mật  Ong và Đường Đen Thefaceshop Honey Black Sugar Scrub', 'ty-da-cht-mt-ong-v-ng-en-thefaceshop-honey-black-sugar-scrub', 'Xuất xứ : Thefaceshop - Korea.\r\nKem Tẩy Da Chết Mật Ong và Đường Đen làm thông thoáng lỗ chân lông, thanh lọc bã nhờn, dầu thừa dưới da.', '<p><a title="Kem Tẩy Da Chết Mật Ong v&agrave; Đường Đen Thefaceshop Honey Black Sugar Scrub" href="/shop/ty-da-cht-peeling/kem-ty-da-cht-mt-ong-v-ng-en-thefaceshop-honey-black-sugar-scrub"><strong><span style="font-size: medium;">Tẩy Da Chết Mật Ong v&agrave; Đường Đen Thefaceshop Honey Black Sugar Scrub</span></strong></a></p>\r\n<p><span style="font-size: medium;">Trọng Lượng: 120ml</span></p>\r\n<p><span style="font-size: medium;">Honey Black Sugar Scrub l&agrave; sản phẩm tẩy tế b&agrave;o chết <a title="chiết xuất từ mật ong nguy&ecirc;n chất, đường đen" href="/shop/ty-da-cht-peeling/kem-ty-da-cht-mt-ong-v-ng-en-thefaceshop-honey-black-sugar-scrub"><strong>chiết xuất từ mật ong nguy&ecirc;n chất, đường đen</strong></a>, gi&uacute;p l&agrave;m mềm v&agrave; l&agrave;m sạch, nhẹ nh&agrave;ng <a title="loại bỏ c&aacute;c tế b&agrave;o chết tr&ecirc;n mặt" href="/shop/ty-da-cht-peeling/kem-ty-da-cht-mt-ong-v-ng-en-thefaceshop-honey-black-sugar-scrub"><strong>loại bỏ c&aacute;c tế b&agrave;o chết tr&ecirc;n mặt</strong></a>, th&uacute;c đẩy c&aacute;c mạch m&aacute;u hoạt động l&agrave;m cho l&agrave;n da ng&agrave;y c&agrave;ng mịn m&agrave;ng, dễ d&agrave;ng hấp thu c&aacute;c loại chất dưỡng da kh&aacute;c.</span></p>\r\n<p><span style="font-size: medium;">Đồng thời Kem Tẩy Da Chết Mật Ong v&agrave; Đường Đen Thefaceshop c&ograve;n cung cấp một lượng lớn chất dinh dưỡng nu&ocirc;i dưỡng da, <a title="c&acirc;n bằng độ ẩm v&agrave; l&agrave;m th&ocirc;ng tho&aacute;ng lỗ ch&acirc;n l&ocirc;ng, thanh lọc b&atilde; nhờn, dầu thừa dưới da, cải thiện t&igrave;nh trạng lỗ ch&acirc;n l&ocirc;ng to." href="/shop/ty-da-cht-peeling/kem-ty-da-cht-mt-ong-v-ng-en-thefaceshop-honey-black-sugar-scrub"><strong>c&acirc;n bằng độ ẩm v&agrave; l&agrave;m th&ocirc;ng tho&aacute;ng lỗ ch&acirc;n l&ocirc;ng, thanh lọc b&atilde; nhờn, dầu thừa dưới da, cải thiện t&igrave;nh trạng lỗ ch&acirc;n l&ocirc;ng to.</strong></a></span></p>\r\n<p><span style="font-size: medium;">Hướng Dẫn Sử Dụng:</span></p>\r\n<p><span style="font-size: medium;">L&agrave;m sạch da v&agrave; lau kh&ocirc;, lấy một lượng sản phẩm vừa đủ ra tay rồi massage nhẹ nh&agrave;ng trong khoảng 30 gi&acirc;y rồi rửa mặt sạch với nước ấm.</span></p>\r\n<p><span style="font-size: medium;">Sử dụng một tuần từ 1-2 lần.</span></p>', '2014_03_03_10_52_15-shopmyphamhan-Kem-tay-da-chet-mat-ong-duong-den-thefaceshop-Honey-Black-Sugar-Scrub.jpg', NULL, 160000, 'TDCTFS3', 1, '0', 0, 0, '0', '1', '1', 1393818735),
(125, 72, 'Costar', 'Sữa Ong Chúa Úc Costar 1450mg (356 viên)', 'sa-ong-cha-c-costar-1450mg-356-vin', 'Xuất xứ : Costar - Australia.\r\nSữa ong chúa Costar có nguồn gốc từ 100% sữa ong chúa tươi nguyên chất, có hàm lượng 1450mg x 365 viên.', '<p><span style="font-size: small;"><strong>Sữa Ong Ch&uacute;a &Uacute;c Costar 1450mg (356 vi&ecirc;n)</strong><br /></span></p>\r\n<p><span style="font-size: small;"><strong>Sữa Ong Ch&uacute;a từ &Uacute;c</strong> l&agrave; chất dinh dưỡng đặc biệt qu&yacute; gi&aacute; được thu thập từ mật hoa, chứa chất đạm v&agrave; nhiều sinh tố bởi những con ong thợ c&ugrave;ng với tuyến họng của n&oacute; tạo th&agrave;nh. Hỗn dược n&agrave;y l&agrave; nguồn thức ăn duy nhất của Ong Ch&uacute;a n&ecirc;n được gọi l&agrave; Sữa Ong Ch&uacute;a - Sữa Ong Ch&uacute;a chiết xuất 100% từ sữa ong ch&uacute;a tự nhi&ecirc;n , kh&ocirc;ng m&agrave;u thực phẩm, kh&ocirc;ng chất bảo quản .</span></p>\r\n<p><span style="font-size: small;">Sản phẩm đ&atilde; được kiểm định v&agrave; đạt c&aacute;c ti&ecirc;u chuẩn cao tại &Uacute;c. </span><br /><br /><span style="font-size: small;">Sữa ong ch&uacute;a gi&agrave;u Vitamin, Ax&iacute;t b&eacute;o v&agrave; đạm hơn mật ong, nhưng lại chứa &iacute;t đường hơn. Đ&acirc;y l&agrave; loại thực phẩm c&oacute; t&aacute;c dụng v&agrave; gi&aacute; trị dinh dưỡng cao cho sức khỏe cũng như việc chăm s&oacute;c sắc đẹp.</span><br /><br /><span style="font-size: small;">Chứa nhiều Amino Ax&iacute;t, c&aacute;c Vitamin quan trọng như B5, B6, B1, B2, Vitamin C c&ugrave;ng những kho&aacute;ng chất như: Đồng, Kali, Sắt, Canxi...Sữa ong ch&uacute;a tốt cho cả phụ nữ lẫn nam giới.</span><br /><br /><span style="font-size: small;">Đối với phụ nữ Sữa ong ch&uacute;a l&agrave;m đẹp da mặt rất tuyệt vời, v&igrave; c&oacute; khả năng l&agrave;m l&agrave;n da mịn m&agrave;ng, tươi m&aacute;t, &iacute;t loại mỹ phẩm n&agrave;o c&oacute; thể s&aacute;nh kịp v&igrave; sữa ch&uacute;a c&oacute; tới 20 Axit Amin tự do, c&aacute;c Vitamin như B1, B2, B6, PP, đặc biệt c&oacute; nhiều Vitamin A, E rất cần cho l&agrave;n da v&agrave; tốt cho cả mắt&hellip; đều c&oacute; ở Sữa ong ch&uacute;a.</span><br /><br /><span style="font-size: small;">Một số C&ocirc;ng ty mỹ phẩm hiện nay tr&ecirc;n thế giới cũng biết phối hợp với Sữa ong ch&uacute;a chế ra mỹ phẩm cao cấp khiến nhiều h&atilde;ng phất l&ecirc;n rất mạnh nhờ dịch Sữa ong ch&uacute;a n&agrave;y.</span></p>\r\n<p><strong><span style="font-size: small;">Những Ưu Điểm Của Sữa Ong Ch&uacute;a COSTAR</span></strong><br /><br /><span style="font-size: small;">- Sữa ong ch&uacute;a Costar 1450mg của &Uacute;c, chiết xuất tự nhi&ecirc;n, kh&ocirc;ng m&agrave;u thực phẩm, kh&ocirc;ng chất bảo quản.</span><br /><br /><span style="font-size: small;">- Gi&uacute;p tăng qu&aacute; tr&igrave;nh trao đổi chất nhờ đ&oacute; cơ thể trẻ l&acirc;u, l&agrave;n da mềm mại, tươi trẻ, x&oacute;a bỏ nếp nhăn, duy tr&igrave; sắc đẹp.</span><br /><br /><span style="font-size: small;">- Gi&uacute;p bảo vệ sức khỏe, chống sự gi&agrave; nua, n&acirc;ng cao tuổi thọ.</span><br /><br /><span style="font-size: small;">- Gi&uacute;p sửa chữa những tế b&agrave;o da bị tổn thương do h&oacute;a chất, tia xạ, tia cực t&iacute;m g&acirc;y ra.</span><br /><br /><span style="font-size: small;">- <strong>Sữa Ong Chua chứa chất kh&aacute;ng sinh tự nhi&ecirc;n ( Anti-bacterial ) gi&uacute;p da chống mụn, ti&ecirc;u mụn, chống vi&ecirc;m da.</strong></span><br /><br /><span style="font-size: small;">- Gi&uacute;p da chống l&atilde;o h&oacute;a, n&aacute;m, sạm do t&aacute;c động của m&ocirc;i trường v&agrave; nhất l&agrave; do thay đổi nội tiết tố ở phụ nữ ( trong thời kỳ m&atilde;n kinh ), v&igrave; <strong>Sữa Ong Ch&uacute;a l&agrave;m thay đổi tận gốc của nguy&ecirc;n nh&acirc;n g&acirc;y n&aacute;m da, sạm da, gi&uacute;p da dần dần trở n&ecirc;n trắng hồng, căng mịn.</strong></span><br /><br /><span style="font-size: small;">- Gi&uacute;p an thần, ngủ ngon, ngủ y&ecirc;n giấc, ph&ograve;ng chống mất ngủ.</span><br /><br /><span style="font-size: small;">- Gi&uacute;p trị bệnh cao m&aacute;u, cao huyết &aacute;p, mỡ trong m&aacute;u, tiểu đường, vi&ecirc;m gan A,B,C,D v&agrave; c&aacute;c bệnh về gan.</span><br /><br /><span style="font-size: small;">- Gi&uacute;p trị c&aacute;c trường hợp nhiễm tr&ugrave;ng do vi khuẩn, nhiễm tr&ugrave;ng đường tiểu, l&agrave;m l&agrave;nh vết thương.</span><br /><br /><span style="font-size: small;">- Gi&uacute;p ph&aacute;t triển tốt thể lực, tr&iacute; tuệ minh mẫn, tăng cường nh&atilde;n lực, l&agrave;m s&aacute;ng mắt.</span><br /><br /><span style="text-decoration: underline;"><span style="font-size: small;">Th&agrave;nh Phần</span></span><br /><br /><span style="font-size: small;">- 100% từ thi&ecirc;n nhi&ecirc;n.</span><br /><br /><span style="font-size: small;">- Vitamin nh&oacute;m A, B, C, D v&agrave; E; gồm 18 amino acids, Protein v&agrave; acid b&eacute;o v&agrave;o 10-HDA gi&uacute;p t&aacute;i tạo l&agrave;n da mang đến cho bạn 1 l&agrave;n da mịn m&agrave;ng v&agrave; khoẻ mạnh.</span><br /><br /><span style="font-size: small;"><span style="text-decoration: underline;">C&aacute;ch d&ugrave;ng</span>: Ng&agrave;y uống 01 lần v&agrave;o buối s&aacute;ng trước khi ăn. </span></p>', '', 800000, 700000, 'SOC1', 1, '0', 0, 0, '0', '1', '1', 1393850179),
(126, 75, 'Well Being Nutrition', 'Sữa Ong Chúa Royal Jelly Wellbeing Nutrition 1600mg (365 viên)', 'sa-ong-cha-royal-jelly-wellbeing-nutrition-1600mg-365-vin', 'Xuất xứ : Well Being Nutrition - Australia.\r\nThúc đẩy tổng hợp glycogen, thúc đẩy quá trình trao đổi chất, giảm thâm nám, tàn nhang. Giúp trẻ hóa và giữ mãi nét thanh xuân cho chị em phụ nữ.', '<p><span style="font-size: small;"><strong style="font-size: small;">Sữa Ong Ch&uacute;a Royal Jelly Wellbeing Nutrition 1600mg (365 vi&ecirc;n)</strong></span></p>\r\n<p><span style="font-size: small;"><strong>Hiện nay, tr&ecirc;n thị trường c&oacute; rất nhiều sữa ong ch&uacute;a Trung Quốc, do người bu&ocirc;n đặt c&aacute;c thương l&aacute;i Trung Quốc l&agrave;m, n&ecirc;n kh&aacute;ch h&agrave;ng h&atilde;y thật cẩn thận , tr&aacute;nh t&igrave;nh trạng " Tiền mất tật mang nh&eacute;".</strong></span></p>\r\n<p><span style="font-size: small;"><strong>Sữa Ong Ch&uacute;a gi&uacute;p bồi bổ sức khỏe, chống l&atilde;o h&oacute;a da gi&uacute;p cơ thể trẻ l&acirc;u, gi&uacute;p da t&oacute;c mịn m&agrave;ng, ngừa mụn, t&agrave;n nhang</strong>. Chống mệt mỏi, trầm cảm l&agrave;m việc qu&aacute; sức, suy nhược, lo lắng k&eacute;o d&agrave;i, mất ngủ, biếng ăn.</span></p>\r\n<p><span style="font-size: small;">C&ocirc;ng dụng Sữa Ong Ch&uacute;a? </span></p>\r\n<p><span style="font-size: small;">1.C&oacute; chứa axit pantothenic, gi&uacute;p cải thiện v&agrave; ngăn ngừa c&aacute;c triệu chứng của bệnh thấp khớp. </span></p>\r\n<p><span style="font-size: small;">2.C&oacute; chứa acetylcholine, điều trị hiệu quả c&aacute;c bệnh về tim mạch Cải thiện hệ thống miễn dịch, tăng cường chức năng sản sinh hồng cầu c&oacute; lợi cho sự tăng trưởng v&agrave; ph&aacute;t triển sức khỏe ở thanh thiếu ni&ecirc;n.</span></p>\r\n<p><span style="font-size: small;">3.Điều h&ograve;a nội tiết tố trong cơ thể để điều trị rối loạn m&atilde;n kinh v&agrave; bệnh vi&ecirc;m tuyến tiền liệt m&atilde;n t&iacute;nh. </span></p>\r\n<p><span style="font-size: small;">4.C&oacute; chứa insulin, tốt cho bệnh nh&acirc;n đang bị tiểu đường. </span></p>\r\n<p><span style="font-size: small;">5.C&oacute; nhiều loại Peptide v&agrave; protein tốt cho sức khỏe, th&uacute;c đầy sự ph&aacute;t triển tr&iacute; tuệ, cải thiện tr&iacute; nhớ.</span></p>\r\n<p><span style="font-size: small;">6.Tăng cường thể trạng, l&agrave;m đẹp da, chống l&atilde;o h&oacute;a, cải thiện sự biếng ăn của cơ thể. <strong>Th&uacute;c đẩy tổng hợp glycogen, th&uacute;c đẩy qu&aacute; tr&igrave;nh trao đổi chất, giảm th&acirc;m n&aacute;m, t&agrave;n nhang. Gi&uacute;p trẻ h&oacute;a v&agrave; giữ m&atilde;i n&eacute;t thanh xu&acirc;n cho chị em phụ nữ</strong> gi&uacute;p mịn v&agrave; l&agrave;m căng l&agrave;n da , x&oacute;a vết th&acirc;m , t&agrave;n nhang ,giữ v&oacute;t d&aacute;ng săn chắc gọn g&agrave;ng v&igrave; chứa nhiều c&aacute;c sinh tố - kh&oacute;ang chất cần thiết cho cơ thể cộng th&ecirc;m 22 loại Amino Acid kh&aacute;c. Nhiều protein gi&uacute;p kh&ocirc;i phục lại sức sống cho l&agrave;n da. Sữa ong ch&uacute;a tăng cường hoạt động t&igrave;nh dục cho nam giới, sau khi sử dụng sữa ong ch&uacute;a c&oacute; chứa c&aacute;c k&iacute;ch th&iacute;ch tố sinh dục cải thiện ham muốn t&igrave;nh dục của nam giới lẫn phụ nữ, cũng c&oacute; thể l&agrave;m chậm c&aacute;c chức năng l&atilde;o h&oacute;a. Sữa ong ch&uacute;a c&oacute; thể cải thiện khả năng di chuyển của tinh tr&ugrave;ng bởi v&igrave; trong đ&oacute; c&oacute; chứa adenosine triphosphate ( ATP ) c&ugrave;ng với nước v&agrave; đường hoạt t&iacute;nh, gi&uacute;p tăng cường năng lượng di chuyển của tinh tr&ugrave;ng.</span></p>', '', NULL, 950000, 'SOC2', 1, '0', 0, 0, '0', '1', '1', 1393859687),
(127, 72, 'Costar', 'Nhau thai cừu úc Costar Placentra Essence of baby sheep 3000Mg (100 viên)', 'nhau-thai-cu-c-costar-placentra-essence-of-baby-sheep-3000mg-100-vin', 'Xuất xứ : Costar - Australia.\r\nViên nhau thai cừu úc giúp làn da trắng sáng, xóa bỏ các vết thâm nám, các vết tàn nhang, làm da căng chống chảy sệ bụng, ngực sau khi sinh.', '<p><a title="Nhau thai cừu &uacute;c Costar Placentra Essence of baby sheep 3000Mg (100 vi&ecirc;n)" href="/shop/Nhau-Thai-Cuu/Nhau-thai-cuu-uc-Costar-Placentra-Essence-of-baby-sheep-3000Mg--100-vien-"><span style="font-size: small;"><strong>Nhau thai cừu &uacute;c Costar <span style="font-size: small;">Placentra Essence of baby sheep</span>&nbsp;3000Mg (100 vi&ecirc;n)</strong></span></a></p>\r\n<p><span style="font-size: small;">Vi&ecirc;n nhau thai cừu Costar Placentra 3000 mg được sản xuất tại &Uacute;c, mỗi vi&ecirc;n nhau thai cừu <a title="chứa 3000mg chiết xuất từ nhau thai cừu" href="/shop/Nhau-Thai-Cuu/Nhau-thai-cuu-uc-Costar-Placentra-Essence-of-baby-sheep-3000Mg--100-vien-"><strong>chứa 3000mg chiết xuất từ nhau thai cừu</strong></a> tươi qua qu&aacute; tr&igrave;nh l&agrave;m lạnh kh&ocirc; ti&ecirc;n tiến gi&uacute;p giữ lại to&agrave;n bộ th&agrave;nh phần dinh dưỡng c&oacute; trong nhau thau cừu. <a title="Gi&uacute;p l&agrave;n da trắng s&aacute;ng, x&oacute;a bỏ c&aacute;c vết th&acirc;m n&aacute;m, c&aacute;c vết t&agrave;n nhang, l&agrave;m da căng chống chảy sệ bụng, ngực." href="/shop/Nhau-Thai-Cuu/Nhau-thai-cuu-uc-Costar-Placentra-Essence-of-baby-sheep-3000Mg--100-vien-"><strong>Gi&uacute;p l&agrave;n da trắng s&aacute;ng, x&oacute;a bỏ c&aacute;c vết th&acirc;m n&aacute;m, c&aacute;c vết t&agrave;n nhang, l&agrave;m da căng chống chảy sệ bụng, ngực.</strong></a><br /></span></p>\r\n<p><span style="font-size: small;">Th&agrave;nh Phần dinh dưỡng c&oacute; trong mỗi 100g<br /></span></p>\r\n<p><span style="font-size: small;">Protein ..................................................24,5g<br />Carbonhydra