="font-size: medium;"> sử dụng h&agrave;ng ng&agrave;y, trước khi make up hoặc trước c&aacute;c bước dưỡng da.</span></p>\r\n<p><span style="font-size: medium;">Hướng Dẫn Sử Dụng:</span></p>\r\n<p><span style="font-size: medium;">Bước 1: Thấm đẫm nước hoa hồng v&agrave;o b&ocirc;ng tẩy trang</span></p>\r\n<p><span style="font-size: medium;">Bước 2: Massage thuận theo đường v&acirc;n tr&ecirc;n da từ trong ra ngo&agrave;i, động t&aacute;c n&agrave;y sẽ gi&uacute;p bạn ngăn chặn sự xuất hiện những nếp nhăn.</span></p>\r\n<p><span style="font-size: medium;">Bước 3: Nếu lượng dầu ở tr&aacute;n v&agrave; mũi b&agrave;i tiết ra qu&aacute; nhiều, bạn c&oacute; thể d&ugrave;ng b&ocirc;ng tẩy trang ở v&ugrave;ng đ&oacute; l&acirc;u hơn 1 ch&uacute;t, sau đ&oacute; mới massage</span></p>\r\n<p><span style="font-size: medium;">Tiếp tục sử dụng c&aacute;c bước chăm s&oacute;c da tiếp theo như serum/essence - emulsion - cream ( nếu c&oacute; ) để đạt được hiệu quả dưỡng v&agrave; đặc trị tối ưu nhất!</span></p>\r\n<p>&nbsp;</p>', '2014_03_04_23_42_05-shopmyphamhan-Nuoc-hoa-hong-lam-sang-da-chiet-xuat-ca-chua-Skinfood-Tomato-Whitening-Toner.jpg', NULL, 310000, 'TONERSF1', 1, '0', 0, 0, '0', '1', '1', 1393932252),
