ng></a> hơn.</span></p>\r\n<p><span style="font-size: medium;">Sử dụng h&agrave;ng ng&agrave;y, trước khi make up hoặc trước c&aacute;c bước dưỡng da.</span></p>\r\n<p><span style="font-size: medium;">Hướng dẫn sử dụng:</span></p>\r\n<p><span style="font-size: medium;">1. Mở nắp chai nước hoa hồng, lấy t&uacute;i tr&agrave; nh&uacute;ng v&agrave;o chai.</span></p>\r\n<p><span style="font-size: medium;">2. Chờ 1 ph&uacute;t lắc nhẹ chai v&agrave; bỏ t&uacute;i tr&agrave; đi.</span></p>\r\n<p><span style="font-size: medium;">3. Lắc nhẹ chai nước hoa hồng v&agrave; mở nắp nhỏ tr&ecirc;n chai để sử dụng.</span></p>\r\n<p><span style="font-size: medium;">4. Sau khi rửa mặt, lấy một lượng vừa đủ v&agrave;o l&ograve;ng b&agrave;n tay hoặc miếng b&ocirc;ng cotton, massage nhẹ nh&agrave;ng l&ecirc;n mặt theo hướng từ trong ra ngo&agrave;i.</span></p>', '2014_03_04_23_37_26-shopmyphamhan-Nuoc-hoa-hong-chiet-xuat-omija-Skinfood-Omija-Whitening-Teabag-Toner.jpg', NULL, 400000, 'TONERSF2', 1, '0', 0, 0, '0', '1', '1', 1393932512),
(132, 67, 'Nước Hoa Hồng - Toner', 'Nước hoa hồng chiết xuất xương rồng Skinfood Agave Cactus Toner', 'nc-hoa-hng-chit-xut-xng-rng-skinfood-agave-cactus-toner', 'Xuất xứ : Skinfood - Korea.\r\nNước hoa hồng chiết xuất xương rồng chống lão hóa và cung cấp độ ẩm cho làn da bạn.\r\n', '<p><span style="font-size: medium;"><a title="Nước hoa hồng chiết xuất xương rồng Skinfood Agave Cactus Toner" href="/shop/nc-hoa-hng-toner/nc-hoa-hng-chit-xut-xng-rng-skinfood-agave-cactus-toner"><strong>Nước hoa hồng chiết xuất xương rồng Skinfood Agave Cactus Toner</strong></a></span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 145m.</span></p>\r\n<p><span style="font-size: medium;">Nước hoa hồng chiết xuất từ </span><a style="font-size: medium;" title="Xương Rồng Skinfood" href="/shop/nc-hoa-hng-toner/nc-hoa-hng-chit-xut-xng-rng-skinfood-agave-cactus-toner"><strong>Xương Rồng Skinfood</strong></a><span style="font-size: medium;"> tự nhi&ecirc;n cung cấp dưỡng chất cho l&agrave;n da, đồng thời </span><a style="font-size: medium;" title="chống l&atilde;o h&oacute;a" href="/shop/nc-hoa-hng-toner/nc-hoa-hng-chit-xut-xng-rng-skinfood-agave-cactus-toner"><strong>chống l&atilde;o h&oacute;a</strong></a><span style="font-size: medium;">, chống lại t&aacute;c động của m&ocirc;i trường.</span></p>\r\n<p><span style="font-size: medium;">Sử dụng </span><a style="font-size: medium;" title="Agave Cactus Toner" href="/shop/nc-hoa-hng-toner/nc-hoa-hng-chit-xut-xng-rng-skinfood-agave-cactus-toner"><strong>Agave Cactus Toner</strong></a><span style="font-size: medium;"> gi&uacute;p hạn chế sự h&igrave;nh th&agrave;nh c&aacute;c nếp nhăn, </span><a style="font-size: medium;" title="tăng độ đ&agrave;n hồi cho l&agrave;n da" href="/shop/nc-hoa-hng-toner/nc-hoa-hng-chit-xut-xng-rng-skinfood-agave-cactus-toner"><strong>tăng độ đ&agrave;n hồi cho l&agrave;n da</strong></a><span style="font-size: medium;">, l&agrave;m mịn m&agrave;ng v&agrave; s&aacute;ng da.</span></p>\r\n<p><span style="font-size: medium;">Hướng dẫn sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Lấy một lượng vừa đủ cho v&agrave;o l&ograve;ng b&agrave;n tay hoặc miếng b&ocirc;ng cotton, thoa nhẹ nh&agrave;ng l&ecirc;n mặt theo hướng từ dưới l&ecirc;n tr&ecirc;n v&agrave; từ trong ra ngo&agrave;i.</span></p>', '2014_03_04_23_19_29-shopmyphamhan-Nuoc-hoa-hong-chiet-xuat-xuong-rong-Skinfood-Agave-Cactus-Toner.jpg', NULL, 400000, 'TONERSF3', 1, '0', 0, 0, '0', '1', '1', 1393932711);
