(135, 69, 'Tinh Chất Dưỡng - Serum', 'Tinh chất dưỡng làm sáng da chiết xuất cà chua Skinfood Tomato Whitening Serum ', 'tinh-cht-dng-lm-sng-da-chit-xut-c-chua-skinfood-tomato-whitening-serum', 'Xuất xứ : SKinfood - Korea.\r\nTinh chất dưỡng làm sáng da chiết xuất cà chua cải thiện làn da xỉn màu, giúp da trắng dần lên một cách tự nhiên.', '<p><span style="font-size: medium;"><strong><a title="Tinh chất dưỡng l&agrave;m s&aacute;ng da chiết xuất c&agrave; chua Skinfood Tomato Whitening Serum" href="/shop/Tinh-Chat-Duong---Serum/Tinh-chat-duong-lam-sang-da-chiet-xuat-ca-chua-Skinfood-Tomato-Whitening-Serum-">Tinh chất dưỡng l&agrave;m s&aacute;ng da chiết xuất c&agrave; chua Skinfood Tomato Whitening Serum</a></strong></span></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 35ml</span></p>\r\n<p><strong style="font-size: small;"><a title="Serum c&agrave; chua dưỡng da s&acirc;u chiết xuất từ Arbutin, lựu v&agrave; c&agrave; chua gi&agrave;u lycopene, vitamin v&agrave; kho&aacute;ng chất, cải thiện l&agrave;n da xỉn m&agrave;u, gi&uacute;p da trắng dần l&ecirc;n một c&aacute;ch tự nhi&ecirc;n." href="/shop/Tinh-Chat-Duong---Serum/Tinh-chat-duong-lam-sang-da-chiet-xuat-ca-chua-Skinfood-Tomato-Whitening-Serum-">Serum c&agrave; chua dưỡng da s&acirc;u chiết xuất từ Arbutin, lựu v&agrave; c&agrave; chua gi&agrave;u lycopene, vitamin v&agrave; kho&aacute;ng chất, cải thiện l&agrave;n da xỉn m&agrave;u, gi&uacute;p da trắng dần l&ecirc;n một c&aacute;ch tự nhi&ecirc;n.</a></strong></p>\r\n<p><span style="font-size: medium;">Tomato Whitening Serum gi&agrave;u dưỡng chất gi&uacute;p cải thiện m&agrave;u sắc da mang lại cho bạn l&agrave;n da s&aacute;ng v&agrave; mềm mịn.</span></p>\r\n<p><span style="font-size: medium;">Hướng Dẫn Sử Dụng:</span></p>\r\n<p><span style="font-size: medium;">C&aacute;ch 1: Sử dụng h&agrave;ng ng&agrave;y, sau khi rửa mặt sạch v&agrave; d&ugrave;ng nước hoa hồng ( toner ) nếu c&oacute;.</span></p>\r\n<p><span style="font-size: medium;"