(215, 67, 'Nước Hoa Hồng - Toner', 'Nước Hoa Hồng 9 in 1 Skin Solution Toner Thefaceshop', 'n-c-hoa-h-ng-9-in-1-skin-solution-toner-thefaceshop', 'Xuất Xứ : Thefaceshop - korea.\r\nChiết xuất trà xanh ( giúp thư giãn & giữ ẩm cho làn da) . Phù hợp với: Mọi loại da, nhất là da nhạy cảm.', '<p><a title="Nước Hoa H&ocirc;̀ng 9 in 1 Skin Solution Toner Thefaceshop" href="/shop/nc-hoa-hng-toner/n-c-hoa-h-ng-9-in-1-skin-solution-toner-thefaceshop"><strong><span style="font-size: medium;">Nước Hoa H&ocirc;̀ng 9 in 1 Skin Solution Toner Thefaceshop</span></strong></a></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 400ml</span><br /><br /><span style="font-size: medium;">- Xử l&yacute; 3.3.3 ( tế b&agrave;o da chết + Trang điểm + C&aacute;c tạp chất c&ograve;n s&oacute;t lại ) trước khi chăm s&oacute;c da.</span></p>\r\n<p><a title="- C&acirc;n bằng độ pH v&agrave; kiểm so&aacute;t l&agrave;n da nhạy cảm ." href="/shop/nc-hoa-hng-toner/n-c-hoa-h-ng-9-in-1-skin-solution-toner-thefaceshop"><span style="font-size: medium;">- <strong>C&acirc;n bằng độ pH v&agrave; kiểm so&aacute;t l&agrave;n da nhạy cảm .</strong></span></a></p>\r\n<p><span style="font-size: medium;">- Mang lại cảm gi&aacute;c tươi m&aacute;t cho l&agrave;n da sau khi sử dụng.</span></p>\r\n<p><span style="font-size: medium;">- Sản phẩm với 6 kh&ocirc;ng ( Paraben , hương thơm nh&acirc;n tạo , chất tạo m&agrave;u, hoạt thạch , động vật, dầu kho&aacute;ng )</span></p>\r\n<p><span style="font-size: medium;"><a title="Sản phẩm 9 in 1 Skin Solution Toner. Tất cả chỉ trong 1" href="/shop/nc-hoa-hng-toner/n-c-hoa-h-ng-9-in-1-skin-solution-toner-thefaceshop"><strong>Sản phẩm 9 in 1 Skin Solution Toner. Tất cả chỉ trong 1</strong></a>, với nhiều t&iacute;nh năng vượt trội:</span></p>\r\n<p><span style="font-size: medium;">- L&agrave;m <a title="sạch lỗ ch&acirc;n l&ocirc;ng" href="/shop/nc-hoa-hng-toner/n-c-hoa-h-ng-9-in-1-skin-solution-toner-thefaceshop"><strong>sạch lỗ ch&acirc;n l&ocirc;ng</strong><