(223, 9, 'Son Môi - TFS', 'Son Face It Artist Touch Lipstick Lesson03 Moisture PK102', 'son-face-it-artist-touch-lipstick-lesson03-moisture-pk102', 'Xuất xứ : Thefaceshop - Korea. \r\nSon môi với độ dưỡng cao giúp làn môi mềm mại và mịn màng hơn nhờ chiết xuất từ lựu và rau má.', '<p><span style="font-size: medium;"><strong><strong><strong>Son Face It Artist Touch Lipstick Lesson03</strong></strong>&nbsp;Moisture PK102</strong></span></p>\r\n<p><span style="font-size: medium;">Dung lượng ; 3,5g.</span></p>\r\n<p><span style="font-size: medium;">Son m&ocirc;i với độ dưỡng cao gi&uacute;p l&agrave;n m&ocirc;i mềm mại v&agrave; mịn m&agrave;ng hơn nhờ chiết xuất từ lựu v&agrave; rau m&aacute;.</span></p>', '2014_03_25_12_21_04-shopmyphamhan-son-lesson-03-thefaceshop-moisture-pk102.jpg', NULL, 180000, 'SONMTFS9', -3, '0', 0, 4, '0', '1', '1', 1395657969),
(226, 9, 'Son Môi - TFS', 'Son Face It Artist Touch Lipstick Lesson03 Creamy Matte OR201', 'son-face-it-artist-touch-lipstick-lesson03-creamy-matte-or201', 'Xuất xứ : Thefaceshop - Korea. \r\nSon môi kết cấu dạng kem ẩm mượt với sắc màu sống động, với chiết xuất từ lựu và rau má giúp mang tới làn môi mịn màng quyến rũ.', '<p><span style="font-size: medium;"><strong><strong><strong>Son Face It Artist Touch Lipstick Lesson03</strong></strong>&nbsp;Creamy Matte OR201</strong></span></p>\r\n<p><span style="font-size: medium;">Dung lượng ; 3,5g.</span></p>\r\n<div id="ctl00_cntMain_ctl01_pnlDescription">\r\n<div class="text-left"><span style="font-size: medium;">Son m&ocirc;i kết cấu dạng kem ẩm mượt với sắc m&agrave;u sống động, với chiết xuất từ lựu v&agrave; rau m&aacute; gi&uacute;p mang tới l&agrave;n m&ocirc;i mịn m&agrave;ng quyến rũ.</span></div>\r\n</div>\r\n<div id="ctl00_cntMain_ctl01_pnlApplication"><span style="font-size: medium;">&nbsp;</span></div>', '2014_03_25_12_17_54-shopmyphamhan-son-lesson-03-thefaceshop-creamy-matte-or201.jpg', NULL, 180000, 'SONMTFS12', 1, '0', 0, 0, '0', '1', '1', 1395658578),
(227, 9, 'Son Môi - TFS', 'Son Face It Artist Touch Lipstick Lesson03 Creamy Matte RD301', 'son-face-it-artist-touch-lipstick-lesson03-creamy-matte-rd301', 'Xuất xứ : Thefaceshop - Korea. \r\nSon môi kết cấu dạng kem ẩm mượt với sắc màu sống động, với chiết xuất từ lựu và rau má giúp mang tới làn môi mịn màng quyến rũ.', '<p><span style="font-size: medium;"><strong><strong><strong>Son Face It Artist Touch Lipstick Lesson03&nbsp;</strong></strong>Creamy Matte RD301</strong></span></p>\r\n<p><span style="font-size: medium;">Dung lượng ; 3,5g.</span></p>\r\n<div id="ctl00_cntMain_ctl01_pnlDescription">\r\n<div class="text-left"><span style="font-size: medium;">Son m&ocirc;i kết cấu dạng kem ẩm mượt với sắc m&agrave;u sống động, với chiết xuất từ lựu v&agrave; rau m&aacute; gi&uacute;p mang tới l&agrave;n m&ocirc;i mịn m&agrave;ng quyến rũ.</span></div>\r\n</div>\r\n<div id="ctl00_cntMain_ctl01_pnlApplication"><span style="font-size: medium;">&nbsp;</span></div>', '2014_03_25_12_28_11-shopmyphamhan-son-lesson-03-thefaceshop-creamy-matte-rd301.jpg', NULL, 180000, 'SONMTFS13', 1, '0', 0, 0, '0', '1', '1', 1395658604);
