(229, 70, 'Kem Dưỡng - Cream', 'Kem Dưỡng Táo Fresh Apple Sparkling Smooth Pore Cream', 'kem-dng-to-fresh-apple-sparkling-smooth-pore-cream', 'Xuất xứ : Skinfood - Korea.\r\nKem dưỡng làm mát và cug cấp nước cho da chiết xuất từ Táo Xanh và nước khoáng có ga giúp điều tiết bã nhờn và se khít lỗ chân lông.', '<p><a title="Kem Dưỡng T&aacute;o Fresh Apple Sparkling Smooth Pore Cream" href="/shop/kem-dng-cream/kem-dng-to-fresh-apple-sparkling-smooth-pore-cream"><strong><span style="font-size: medium;">Kem Dưỡng T&aacute;o Fresh Apple Sparkling Smooth Pore Cream</span></strong></a></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 30ml</span></p>\r\n<p><span style="font-size: medium;"><a title="Kem dưỡng l&agrave;m m&aacute;t v&agrave; cug cấp nước cho da chiết xuất từ T&aacute;o Xanh" href="/shop/kem-dng-cream/kem-dng-to-fresh-apple-sparkling-smooth-pore-cream"><strong>Kem dưỡng l&agrave;m m&aacute;t v&agrave; cug cấp nước cho da chiết xuất từ T&aacute;o Xanh</strong></a> v&agrave; nước kho&aacute;ng c&oacute; ga gi&uacute;p <a title="điều tiết b&atilde; nhờn v&agrave; se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng." href="/shop/kem-dng-cream/kem-dng-to-fresh-apple-sparkling-smooth-pore-cream"><strong>điều tiết b&atilde; nhờn v&agrave; se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng.</strong></a></span></p>\r\n<p><span style="font-size: medium;"><a title="[C&acirc;u chuyện về T&aacute;o]" href="/shop/kem-dng-cream/kem-dng-to-fresh-apple-sparkling-smooth-pore-cream"><strong>[C&acirc;u chuyện về T&aacute;o]</strong></a> : </span></p>\r\n<p><span style="font-size: medium;">Chắc hẳn bạn đ&atilde; từng nghe c&acirc;u ngạn ngữ &ldquo;Mỗi ng&agrave;y một quả t&aacute;o - Thầy thuốc kh&ocirc;ng đến nh&agrave;&rdquo; Những lợi &iacute;ch của t&aacute;o đối với sức khỏe đ&atilde; được biết từ thời xa xưa v&agrave; được xem như l&agrave; loại tr&aacute;i qu&yacute; m&agrave; thượng đế d&agrave;nh ban tặng cho con người. Ăn một quả t&aacute;o mỗi ng&agrave;y sẽ mang đến nhiều lợi &iacute;ch cho sức khỏe, v&oacute;c d&aacute;ng v&agrave; l&agrave;n da. Đặc biệt, trong t&aacute;o xanh chưa ch&iacute;n rất gi&agrave;u chất xơ, vitamin C, chất Polyphenol gi&uacute;p chống l&atilde;o h&oacute;a, l&agrave;m sạch v&agrave; tăng độ đ&agrave;n hồi cho da. T&aacute;o xanh chưa ch&iacute;n thường c&oacute; vị ch&aacute;t do chứa h&agrave;m lượng Tannin cao, một chất được chứng minh l&agrave; c&oacute; t&aacute;c dụng <a title="se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng v&agrave; l&agrave;m săn chắc da" href="/shop/kem-dng-cream/kem-dng-to-fresh-apple-sparkling-smooth-pore-cream"><strong>se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng v&agrave; l&agrave;m săn chắc da</strong></a> một c&aacute;ch hiệu quả.</span></p>\r\n<p><span style="font-size: medium;"><a title="[C&acirc;u chuyện về nước kho&aacute;ng c&oacute; ga]" href="/shop/kem-dng-cream/kem-dng-to-fresh-apple-sparkling-smooth-pore-cream"><strong>[C&acirc;u chuyện về nước kho&aacute;ng c&oacute; ga]</strong></a> : Ch&uacute;ng t&ocirc;i d&ugrave;ng nước kho&aacute;ng c&oacute; ga Cho Jung , một trong những loại nước kho&aacute;ng c&oacute; ga tốt nhất tr&ecirc;n thế giới , được biết đến như nước thần từ phương Đ&ocirc;ng c&oacute; <a title="t&aacute;c dụng l&agrave;m m&aacute;t v&agrave; lấy lại m&agrave;u da tự nhi&ecirc;n ." href="/shop/kem-dng-cream/kem-dng-to-fresh-apple-sparkling-smooth-pore-cream"><strong>t&aacute;c dụng l&agrave;m m&aacute;t v&agrave; lấy lại m&agrave;u da tự nhi&ecirc;n .</strong></a></span></p>\r\n<p><span style="font-size: medium;">Hướng dẫn sử dụng:</span></p>\r\n<p><span style="font-size: medium;">D&ugrave;ng trong bước dưỡng da cuối c&ugrave;ng , lấy một lượng vừa đủ l&ecirc;n những v&ugrave;ng c&oacute; dầu v&agrave; lỗ ch&acirc;n l&ocirc;ng to.</span></p>', '2014_03_29_22_42_02-shopmyphamhan-kem-dng-to-fresh-apple-sparkling-smooth-pore-cream.jpg', NULL, 190000, 'CREAMSF04', 1, '0', 0, 0, '0', '1', '1', 1396107602),
(230, 34, 'Sữa Rửa Mặt - Cleansing Foam', 'Sữa rửa mặt chiết xuất trà đen và mật ong Honey Black Tea Jelly Foam', 'sa-ra-mt-chit-xut-tr-en-v-mt-ong-honey-black-tea-jelly-foam', 'Xuất xứ : Skinfood - Korea.\r\nSữa rửa mặt giàu độ ẩm giúp loại bỏ tế bào chết, se khít lỗ chân lông đồng thời làm mát và cân bằng độ ẩm cho da.', '<p><a title="Sữa rửa mặt chiết xuất tr&agrave; đen v&agrave; mật ong Honey Black Tea Jelly Foam" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-chit-xut-tr-en-v-mt-ong-honey-black-tea-jelly-foam"><strong><span style="font-size: medium;"><span style="font-size: medium;">Sữa rửa mặt chiết xuất tr&agrave; đen v&agrave; mật ong&nbsp;</span>Honey Black Tea Jelly Foam</span></strong></a></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch: 170ml</span></p>\r\n<p><span style="font-size: medium;"><a title="Sữa rửa mặt l&agrave;m dịu v&agrave; l&agrave;m sạch dạng gel chiết xuất mật ong v&agrave; tr&agrave;" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-chit-xut-tr-en-v-mt-ong-honey-black-tea-jelly-foam"><strong>Sữa rửa mặt l&agrave;m dịu v&agrave; l&agrave;m sạch dạng gel chiết xuất mật ong v&agrave; tr&agrave;</strong></a> <strong>gi&agrave;u độ ẩm gi&uacute;p <a title="loại bỏ tế b&agrave;o chết, se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng đồng thời l&agrave;m m&aacute;t v&agrave; c&acirc;n bằng độ ẩm cho da" href="/shop/sa-ra-mt-cleansing-foam/sa-ra-mt-chit-xut-tr-en-v-mt-ong-honey-black-tea-jelly-foam">loại bỏ tế b&agrave;o chết, se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng đồng thời l&agrave;m m&aacute;t v&agrave; c&acirc;n bằng độ ẩm cho da</a>.</strong> Th&agrave;nh phần beta-glucan v&agrave; th&agrave;nh phần dưỡng ẩm tự nhi&ecirc;n l&agrave;m giảm t&igrave;nh trạng mất nước sau khi rửa mặt.</span></p>\r\n<p><span style="font-size: medium;">Hướng dẫn sử dụng:</span></p>\r\n<p><span style="font-size: medium;">Lấy một lượng vừa đủ cho v&agrave;o l&ograve;ng b&agrave;n tay, tạo bọt. M&aacute;t-xa l&ecirc;n mặt v&agrave; rửa lại với nước ấm.</span></p>', '2014_03_29_22_52_19-shopmyphamhan-sa-ra-mt-chit-xut-tr-en-v-mt-ong-honey-black-tea-jelly-foam.jpg', NULL, 170000, 'SRMSF1', 1, '0', 0, 0, '0', '1', '1', 1396108116),
