(241, 18, 'Mascara - Eyeliner - TFS', 'Mascara EX Waterproof  Daily Proof _ Brown', 'mascara-ex-waterproof-daily-proof-brown', 'Xuất xứ : Thefaceshop - Korea.\r\nMascara EX Waterproof  Daily Proof làm dày, dài, đen mi và không thấm nước', '<p><a title="Mascara EX Waterproof  Daily Proof _ Brown" href="/shop/Mascara---Eyeliner---TFS/mascara-ex-waterproof-daily-proof-brown"><strong><span style="font-size: medium;">Mascara EX Waterproof &nbsp;Daily Proof _ Brown</span></strong></a></p>\r\n<p><span style="font-size: medium;"><span>Mascara EX Waterproof&nbsp;</span>được sản xuất với th&agrave;nh phần từ thi&ecirc;n nhi&ecirc;n, bổ sung dưỡng chất m&agrave; kh&ocirc;ng g&acirc;y k&iacute;ch ứng mắt. Kiểu d&aacute;ng đẹp, sang trọng v&agrave; tiện dụng.</span></p>\r\n<p><span style="font-size: medium;">C&ocirc;ng dụng vượt trội l&agrave; khả năng <a title="l&agrave;m d&agrave;y, d&agrave;i, đen mi v&agrave; kh&ocirc;ng thấm nước" href="/shop/Mascara---Eyeliner---TFS/mascara-ex-waterproof-daily-proof-brown"><strong>l&agrave;m d&agrave;y, d&agrave;i, đen mi v&agrave; kh&ocirc;ng thấm nước</strong></a>. Thiết kế đầu cọ đặc biệt kh&ocirc;ng g&acirc;y lem, v&oacute;n cục hoặc l&agrave;m nặng mi. Bạn c&oacute; thể dễ d&agrave;ng tẩy v&agrave; l&agrave;m sạch với nước ấm hoặc <a title="tẩy trang chuy&ecirc;n dụng cho v&ugrave;ng mắt" href="/shop/ty-trang-mt-mi-lip-eye-makeup-remover/t-y-trang-m-t-mi-rice-water-bright-lip-and-eye-remover"><strong>tẩy trang chuy&ecirc;n dụng cho v&ugrave;ng mắt</strong></a> nh&eacute;!</span></p>', '2014_04_05_11_02_47-shopmyphamhan-mascara-ex-waterproof-daily-proof-brown.jpg', NULL, 180000, '', 1, '0', 0, 0, '0', '1', '1', 1396670370),
