(250, 15, 'Son Tint - Son Dưỡng Môi - TFS', 'Son Dưỡng Lovely Meex Sweet Kiss Balm Choco Vanilla', 'son-dng-lovely-meex-sweet-kiss-balm-choco-vanilla', 'Xuất xứ : Thefaceshop - Korea. \r\nSon dưỡng môi Sweet Kiss Balm Choco Vanilla không màu, giúp dưỡng ẩm cho làn môi khô nhờ chiết xuất từ tinh dầu hạt Macadamia.', '<p><a title="Son Dưỡng Lovely Meex Sweet Kiss Balm Choco Vanilla" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-sweet-kiss-balm-choco-vanilla"><span style="font-size: medium;"><strong>Son Dưỡng Lovely Meex Sweet Kiss Balm Choco Vanilla</strong></span></a></p>\r\n<p><span style="font-size: medium;">Dung lượng: 3.8g.</span></p>\r\n<p><span style="font-size: medium;">Son dưỡng m&ocirc;i </span><strong style="font-size: medium;"><a title="Sweet Kiss Balm Choco Vanilla" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-sweet-kiss-balm-choco-vanilla">Sweet Kiss Balm Choco Vanilla</a>&nbsp;</strong><span style="font-size: medium;">kh&ocirc;ng m&agrave;u, gi&uacute;p dưỡng ẩm cho l&agrave;n m&ocirc;i kh&ocirc; nhờ chiết xuất từ tinh dầu hạt Macadamia.</span></p>', '2014_04_07_11_10_29-shopmyphamhan-son-dng-lovely-meex-sweet-kiss-balm-choco-vanilla.png', NULL, 110000, 'SONDTFS4', 1, '0', 0, 0, '0', '1', '1', 1396843550),
(251, 15, 'Son Tint - Son Dưỡng Môi - TFS', 'Son Dưỡng Lovely Meex Mangoseed Lipcare 01 Punica', 'son-dng-lovely-meex-mangoseed-lipcare-01-punica', 'Xuất xứ : Thefaceshop - Korea.\r\nMang đến làn môi hồng tự nhiên hương thơm trái lựu tinh tế.', '<p><a title="Son Dưỡng Lovely Meex Mangoseed Lipcare 01 Punica" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-mangoseed-lipcare-01-punica"><strong><span style="font-size: medium;">Son Dưỡng Lovely Meex Mangoseed Lipcare 01 Punica</span></strong></a></p>\r\n<p><span style="font-size: medium;">Dung lượng : 3.8g.</span></p>\r\n<p><span style="font-size: medium;">Son dưỡng m&ocirc;i </span><a title="Mangoseed Lipcare 01 Punica với chiết xuất từ xo&agrave;i v&agrave; bơ hạt xo&agrave;i" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-mangoseed-lipcare-01-punica"><strong><span style="font-size: medium;">Mangoseed Lipcare 01 Punica&nbsp;</span></strong></a><span style="font-size: medium;"><a title="Mangoseed Lipcare 01 Punica với chiết xuất từ xo&agrave;i v&agrave; bơ hạt xo&agrave;i" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-mangoseed-lipcare-01-punica"><strong>với chiết xuất từ xo&agrave;i v&agrave; bơ hạt xo&agrave;i</strong></a> gi&uacute;p bổ sung ẩm l&agrave;m mềm m&ocirc;i. Mang đến l&agrave;n m&ocirc;i hồng tự nhi&ecirc;n hương thơm tr&aacute;i lựu tinh tế.</span></p>', '2014_04_07_11_20_37-shopmyphamhan-son-dng-lovely-meex-mangoseed-lipcare-01-punica.jpg', NULL, 110000, 'SONDTFS5', 1, '0', 0, 0, '0', '1', '1', 1396844178),
(252, 15, 'Son Tint - Son Dưỡng Môi - TFS', 'Son Dưỡng Lovely Meex Mangoseed Lipcare 02 Honey', 'son-dng-lovely-meex-mangoseed-lipcare-02-honey', 'Xuất xứ : Thefaceshop - Korea.\r\nMangoseed Lipcare 02 Honey trong suốt không màu.\r\n', '<p><a title="Son Dưỡng Lovely Meex Mangoseed Lipcare 02 Honey" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-mangoseed-lipcare-02-honey"><strong><span style="font-size: medium;">Son Dưỡng Lovely Meex Mangoseed Lipcare 02 Honey</span></strong></a></p>\r\n<p><span style="font-size: medium;">Dung lượng : 3.8g.</span></p>\r\n<p><span style="font-size: medium;">Son dưỡng m&ocirc;i<a title=" Mangoseed Lipcare 02 Honey trong suốt kh&ocirc;ng m&agrave;u" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-mangoseed-lipcare-02-honey"> <strong>Mangoseed Lipcare 02 Honey&nbsp;trong suốt kh&ocirc;ng m&agrave;u</strong></a>, mang đến l&agrave;n m&ocirc;i ẩm mượt v&agrave; mềm mại nhờ <a title="chiết xuất từ xo&agrave;i v&agrave; mật ong." href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-mangoseed-lipcare-02-honey"><strong>chiết xuất từ xo&agrave;i v&agrave; mật ong.</strong></a></span></p>', '2014_04_07_11_23_31-shopmyphamhan-son-dng-lovely-meex-mangoseed-lipcare-02-honey.jpg', NULL, 110000, 'SONDTFS6', 1, '0', 0, 0, '0', '1', '1', 1396844309),
(253, 15, 'Son Tint - Son Dưỡng Môi - TFS', 'Son Dưỡng Lovely Meex Dessert Lip Balm 01 Strawberry', 'son-dng-lovely-meex-dessert-lip-balm-01-strawberry', 'Xuất xứ : Thefaceshop - Korea. \r\nSon dưỡng môi Dessert Lip Balm 01 Strawberry với hương dâu quyến rũ', '<p><a title="Son Dưỡng Lovely Meex Dessert Lip Balm 01 Strawberry" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-dessert-lip-balm-01-strawberry"><span style="font-size: medium;"><strong>Son Dưỡng Lovely Meex Dessert Lip Balm 01 Strawberry</strong></span></a></p>\r\n<p><span style="font-size: medium;">Dung lượng : 6g.</span></p>\r\n<p><span style="font-size: medium;">Son dưỡng m&ocirc;i <a title="Dessert Lip Balm 01 Strawberry với hương d&acirc;u quyến rũ" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-dessert-lip-balm-01-strawberry"><strong>Dessert Lip Balm 01 Strawberry&nbsp;với hương d&acirc;u quyến rũ</strong></a>, gi&agrave;u vitamin gi&uacute;p l&agrave;m s&aacute;ng v&agrave; dưỡng ẩm cho l&agrave;n m&ocirc;i.</span></p>\r\n<p><span style="font-size: medium;"><img title="Son Dưỡng Lovely Meex Dessert Lip Balm 01 Strawberry 1" src="/uploads/img_product_detail/Son-duong-Dessert-Lip-Balm-Thefaceshop.jpg" alt="Son Dưỡng Lovely Meex Dessert Lip Balm 01 Strawberry 1" width="500" height="547" /></span></p>', '2014_04_07_11_58_06-shopmyphamhan-son-dng-lovely-meex-dessert-lip-balm-01-strawberry.jpg', NULL, 140000, 'SONDTFS7', 1, '0', 0, 0, '0', '1', '1', 1396846057),
(254, 15, 'Son Tint - Son Dưỡng Môi - TFS', 'Son dưỡng Lovely Meex Dessert Lip Balm 02 Orange', 'son-dng-lovely-meex-dessert-lip-balm-02-orange', 'Xuất xứ : Thefaceshop - Korea.\r\nSon dưỡng môi Meex Dessert Lip Balm 02 Orange với hương cam ngot ngào\r\n', '<p><a title="Son dưỡng Lovely Meex Dessert Lip Balm 02 Orange" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-dessert-lip-balm-02-orange"><span style="font-size: medium;"><strong><strong>Son dưỡng&nbsp;</strong>Lovely Meex Dessert Lip Balm 02 Orange</strong></span></a></p>\r\n<p><span style="font-size: medium;">Dung lượng : 6g.</span></p>\r\n<p><span style="font-size: medium;">Son dưỡng m&ocirc;i<strong><a title="Meex Dessert Lip Balm 02 Orange với hương cam ngot ng&agrave;o" href="/shop/son-tint-son-d-ng-mi-tfs/son-dng-lovely-meex-dessert-lip-balm-02-orange"> <strong>Meex Dessert Lip Balm 02 Orange&nbsp;</strong>với hương cam ngot ng&agrave;o</a>, </strong>gi&uacute;p l&agrave;m dịu v&agrave; phục hồi độ ẩm cho đ&ocirc;i l&agrave;n m&ocirc;i kh&ocirc;, nứt nẻ.</span></p>', '2014_04_07_12_04_26-shopmyphamhan-son-dng-lovely-meex-dessert-lip-balm-02-orange.jpg', NULL, 140000, 'SONDTFS8', 1, '0', 0, 0, '0', '1', '1', 1396846249),
