(256, 63, 'Mặt Nạ Dưỡng - Wash off', 'Gel Lô Hội Aloe Vera Soothing Gel 92% ', 'gel-l-hi-aloe-vera-soothing-gel-92', 'Xuất xứ : Nature Republic - Korea.\r\nAloe Vera Soothing Gel 92% với 8 công dụng : dưỡng da, dưỡng tóc, dưỡng toàn thân...', '<p><a title="Gel L&ocirc; Hội Aloe Vera Soothing Gel 92% " href="/shop/mt-n-dng-wash-off/gel-l-hi-aloe-vera-soothing-gel-92"><strong><span style="font-size: medium;">Gel L&ocirc; Hội Aloe Vera Soothing Gel 92%&nbsp;</span></strong></a></p>\r\n<p><span style="font-size: medium;">Dung t&iacute;ch : 300ml.</span></p>\r\n<p><span style="font-size: medium;"><a title="Soothing &amp; Moisture Aloe Vera Soothing Gel 92% c&oacute; 8 c&ocirc;ng dụng" href="/shop/mt-n-dng-wash-off/gel-l-hi-aloe-vera-soothing-gel-92"><strong>Soothing &amp; Moisture Aloe Vera Soothing Gel 92%&nbsp;c&oacute; 8 c&ocirc;ng dụng</strong></a> như sau:</span></p>\r\n<p><span style="font-size: medium;">1. Cung cấp nước v&agrave; độ ẩm cho da hỗn hợp v&agrave; da kh&ocirc;: bằng c&aacute;ch đắp mặt nạ khoảng 20 ph&uacute;t sau đ&oacute; rửa mặt sạch bằng nước.</span></p>\r\n<p><span style="font-size: medium;">2. Se kh&iacute;t lỗ ch&acirc;n l&ocirc;ng: bằng c&aacute;ch thoa 1 lớp mỏng v&agrave; massage to&agrave;n da mặt.</span></p>\r\n<p><span style="font-size: medium;">3. Dưỡng t&oacute;c lu&ocirc;n mượt m&agrave;: bằng c&aacute;ch thoa 1 lớp gel l&ecirc;n t&oacute;c trước khi sấy&nbsp;<span>(sử dụng ở ngọn t&oacute;c).</span></span></p>\r\n<p><span style="font-size: medium;">4. Thư gi&atilde;n mắt: bằng c&aacute;ch l&agrave;m ướt 2 miếng b&ocirc;ng tẩy trang, thấm gel rồi đắp l&ecirc;n mắt khoảng 20 ph&uacute;t (<span>cẩn thận gel v&agrave;o mắt).</span></span></p>\r\n<p><span style="font-size: medium;">5. Dưỡng m&oacute;ng: bằng c&aacute;ch thoa l&ecirc;n m&oacute;ng tay v&agrave; ch&acirc;n tạo độ ẩm v&agrave; độ b&aacute;m m&agrave;u cho m&oacute;ng.</span></p>\r\n<p><span style="font-size: medium;">6. Dưỡng da to&agrave;n th&acirc;n gi&uacute;p da tr&aacute;nh bị kh&ocirc;: bằng c&aacute;ch thoa to&agrave;n th&acirc;n như lotion để tr&aacute;nh da bị kh&ocirc; khi ngồi trong m&aacute;y lạnh.</span></p>\r\n<p><span style="font-size: medium;">7. Gi&uacute;p tr&aacute;nh bị trầy da khi cạo l&ocirc;ng hoặc cạo r&acirc;u: bằng c&aacute;ch thoa 1 lớp gel trước khi cạo.</span></p>\r\n<p><span style="font-size: medium;">8. L&agrave;m dịu da sau khi đi nắng, tắm biển hoặc sau khi wax l&ocirc;ng.</span></p>', '2014_04_08_14_58_11-shopmyphamhan-gel-lo-hoi-aloe-vera-soothing-gel-92.jpg', NULL, 130000, 'MASKNR1', 1, '0', 0, 0, '0', '1', '1', 1396943491);
